INSERT INTO `infos` (`id`, `type`, `title`, `content`) VALUES
(1, 'Pendaftaran', 'Peserta PPU Penyelenggara Negara', 'Pejabat Negara\n Fotokopi Kartu Keluarga\n Asli petikan SK Penetapan pertama\n Asli kepangkangkatan/pengangkatan\nterakhir dari\nkementerian/lembaga/Kepada Dinas (jika ada perubahan)  Asli Daftar Gaji terakhir yang mencantumkan gapok dan tunjangan keluarga, tunjangan\njabatan/tunjangan umum, tunjangan profesi, dan tujangan kinerja atau tunjangan tambahan penghasilan bagi PNS Daerah\n Asli penetapan pengadilan untuk anak angkat (jika belum tercantum dalam Kartu Keluarga)\n Asli surat keterangan sekolah/perguruan tinggi (untuk anak PPU 1-3 yang berusia lebih dari 21 tahun sampai dengan 25 tahun)\n\nPNS Pusat/Daerah\n Fotokopi Kartu Keluarga\n Asli petikan SK Penetapan pertama\n Asli kepangkangkatan/pengangkatan\nterakhir dari kementerian/lembaga/Kepada Dinas (jika ada perubahan)\n Asli Daftar Gaji terakhir yang mencantumkan gapok dan tunjangan keluarga, tunjangan\njabatan/tunjangan umum, tunjangan profesi, dan tujangan kinerja atau tunjangan tambahan penghasilan bagi PNS Daerah\n Asli penetapan pengadilan untuk anak angkat (jika belum tercantum dalam Kartu Keluarga)\n Asli surat keterangan sekolah/perguruan tinggi ( untuk\nanak PPU 1-3 yang berusia lebih dari 21 tahun sampai dengan 25 tahun)\n\nPNS yang Diperkerjakan di BUMN/BUMD\n Fotokopi Kartu Keluarga\n Asli petikan SK Penetapan pertama\n Asli kepangkangkatan/pengangkatan\nterakhir dari\nkementerian/lembaga/Kepada\nDinas (jika ada perubahan)\n Asli Daftar Gaji terakhir yang\nmencantumkan gapok dan\ntunjangan keluarga, tunjangan\njabatan/tunjangan umum,\ntunjangan profesi, dan tujangan kinerja atau tunjangan tambahan penghasilan bagi PNS Daerah\n Asli penetapan pengadilan untuk anak angkat (jika belum tercantum dalam Kartu Keluarga)\n Asli surat keterangan sekolah/perguruan tinggi (untuk\nanak PPU 1-3 yang berusia lebih dari 21 tahun sampai dengan 25\ntahun)\n\nTNI atau PNS TNI\n Fotokopi Kartu Keluarga\n Asli petikan SK Penetapan pertama\n Asli\nkepangkangkatan/pengangkatan\nterakhir dari\nkementerian/lembaga/Kepada\nDinas (jika ada perubahan)\n Asli Daftar Gaji terakhir yang mencantumkan gapok dan\ntunjangan keluarga, tunjangan\njabatan/tunjangan umum, tunjangan profesi, dan tujangan kinerja atau tunjangan tambahan\npenghasilan bagi PNS Daerah\n Asli penetapan pengadilan untuk anak angkat (jika belum tercantum dalam Kartu Keluarga)\n Asli surat keterangan sekolah/perguruan tinggi (untuk\nanak PPU 1-3 yang berusia lebih dari 21 tahun sampai dengan 25\ntahun)\n\nPOLRI atau PNS POLRI\n Fotokopi Kartu Keluarga\n Asli petikan SK Penetapan pertama\n Asli\nkepangkangkatan/pengangkatan\nterakhir dari\nkementerian/lembaga/Kepada\nDinas (jika ada perubahan)\n Asli Daftar Gaji terakhir yang mencantumkan gapok dan tunjangan keluarga, tunjangan jabatan/tunjangan umum, tunjangan profesi, dan tujangan kinerja atau tunjangan tambahan\npenghasilan bagi PNS Daerah\n Asli penetapan pengadilan untuk anak angkat (jika belum tercantum dalam Kartu Keluarga)\n Asli surat keterangan sekolah/perguruan tinggi ( untuk\nanak PPU 1-3 yang berusia lebih\ndari 21 tahun sampai dengan 25 tahun)\nKhusus untuk kepesertaan dari DPRD dan PPNPN, proses pendaftaran dilakukan secara\nkolektif melalui proses registrasi entitas satuan kerja dan penyampaian data peserta dan anggota keluarganya melalui proses migrasi. Masa berlaku kepesertaan mengikuti periode masa bakti DPRD/masa kontrak\nPPNPN.\n\nKanal layanan pendaftaran:\n Mobile Customer Service (MCS) Peserta mengunjungi Mobile Customer Service (MCS) pada hari dan jam yang telah ditentukan, melengkapi persyaratan yang dibutuhkan, mengisi Formulir\nDaftar Isian Peserta (FDIP) dan menunggu antrian untuk mendapatkan pelayanan. Mall Pelayanan Publik\nPeserta mengunjungi Mall Pelayanan Publik, melengkapi\npersyaratan yang dibutuhkan,\nmengisi Formulir Daftar Isian\nPeserta (FDIP) dan menunggu antrian untuk mendapatkan pelayanan.\n Kantor Cabang dan Kantor Kabupaten/Kota Peserta mengunjungi Kantor Cabang/Kantor Kabupaten/Kota,\nmengambil nomor antrian\npelayanan korporasi, melengkapi persyaratan yang dibutuhkan,\nmengisi Formulir Daftar Isian\nPeserta (FDIP) dan menunggu antrian untuk mendapatkan pelayanan.'),
(2, 'Pendaftaran', 'Peserta PPU Non Penyelenggara Negara (BUMN, BUMD dan BU Swasta)', 'Pendaftaran dapat dilakukan secara kolektif oleh pemberi kerja/PIC masing-masing Badan Usaha, dengan cara melengkapi Formulir Daftar Isian Elektronik yang diisi sesuai ketentuan yang berlaku dan disahkan oleh pimpinan perusahaan untuk\ndimigrasikan di Kantor Cabang BPJS Kesehatan.\n1. Syarat pendaftaran antara lain:  Surat Izin Usaha Perdagangan (SIUP)/ Surat izin lainnya sesuai kebijakan Pemerintah setempat.  Tanda Daftar Perusahaan (TDP)  Akta Notaris/Yayasan/Pendirian MOU/Perjanjian Kerja Sama dengan Pemerintah\n2. Kanal layanan:\na. Website bersama BPJS\nKesehatan dan BPJS\nKetenagakerjaan\nPIC Badan Usaha mengakses\nWebsite dengan alamat http://www.bpjs.go.id/, lalu klik\ntombol Daftar dan masukkan\ndata yang dibutuhkan. PIC Badan\nUsaha akan mendapatkan hak\nakses Aplikasi New Edabu\nberupa User name dan password.\nb. Aplikasi New Edabu\n PIC Badan Usaha mengakses Aplikasi Elektronik Data Badan Usaha (eDabu) melalui alamat http://www.bpjs.go.id/, pilih menu Registrasi Badan Usaha atau menu Sign in (jika sudah\nmemiliki user name dan password) dan masukkan data\nyang dibutuhkan.\n Data pekerja dan anggota keluarga yang didaftarkan\nselanjutnya akan divalidasi oleh BPJS Kesehatan Kantor\nCabang atau Kantor\nKabupaten/Kota.\nc. Online Single Submission (OSS)\n OSS atau Perizinan Berusaha Terintegrasi Secara Elektronik adalah Perizinan Berusaha yang diterbitkan oleh Lembaga OSS untuk dan atas nama\nmenteri, pimpinan lembaga, gubernur, atau bupati/wali kota\nkepada Pelaku Usaha melalui\nsistem elektronik yang\nterintegrasi.\n PIC Badan usaha mengakses\nWebsite resmi OSS melalui\nalamat http://oss.go.id/, pilih menu Daftar dan ikuti petunjuk dalam Website tersebut.  Setelah sukses pendaftaran, BPJS Kesehatan mengirimkan tautan aktivasi secara realtime\nkepada Badan Usaha Baru dimaksud melalui email yang\ntelah didaftarkan. Badan Usaha\nmelakukan aktivasi melalui\ntautan dimaksud paling lama 2\n(dua) hari kerja.\n PIC Badan Usaha akan\nmendapatkan hak akses Aplikasi New Edabu berupa\nusername dan password.\nd. Kantor Cabang dan Kantor\nKabupaten/Kota\nPIC Badan Usaha mengunjungi\nKantor Cabang atau Kantor\nKabupaten/Kota, mengambil\nnomor antrian pelayanan\nkorporasi, melengkapi\npersyaratan yang dibutuhkan dan\nmenunggu antrian untuk\nmendapatkan pelayanan.'),
(3, 'Pendaftaran', 'Peserta PBI APBD', 'Pendaftaran dilakukan melalui pendataan oleh Dinas Sosial/Dinas yang ditunjuk oleh Pemerintah Provinsi/Kabupaten/Kota, selanjutnya ditetapkan melalui Keputusan Gubernur/Walikota/Bupati. Data kepesertaan PBI di perbaharui secara periodik.'),
(4, 'Pendaftaran', 'Peserta PBI APBN', 'Pendaftaran dilakukan melalui pendataan oleh Kementerian Sosial/Dinas Sosial Kabupaten/Kota sesuai kriteria yang telah ditentukan Pemerintah Pusat. Selanjutnya ditetapkan melalui Keputusan Menteri Sosial dan didaftarkan oleh Kementerian Kesehatan. Data kepesertaan PBI di perbaharui secara periodik.'),
(5, 'Pendaftaran', 'Peserta PBPU/BP', '1. Kantor Cabang\na. Tata Cara Pendaftaran\n Calon peserta mengunjungi\nBPJS Kesehatan Kantor Cabang atau Kantor\nKabupaten/Kota, melengkapi persyaratan yang dibutuhkan, mengisi Formulir Daftar Isian Peserta (FDIP) dan menunggu antrian untuk mendapatkan pelayanan.\n Setelah data lengkap, calon peserta akan menerima nomor virtual account yang digunakan\nuntuk pembayaran iuran pertama yang akan dikirim\nmelalui SMS.\n Calon peserta dapat\nmelakukan pembayaran iuran\npertama dalam waktu paling cepat 14 (empat belas) hari\natau paling lambat 30 (tiga puluh) hari setelah\npendaftaran.\n Setelah melakukan\npembayaran Kartu JKN-KIS\nditerima peserta.\nb. Persyaratan :\n Formulir daftar isian peserta (Dapat diambil / diisi di Kantor Cabang)\n Asli KTP\n Asli Kartu Keluarga\n Memiliki Nomor Handphone\n Memiliki Email\nFotokopi nomor rekening bank\npada buku tabungan\n Surat Kuasa autodebet\npembayaran iuran bagi yang\nmemilih kelas perawatan I dan II \n Pembayaran iuran melalui autodebet\n Fotokopi paspor dan surat izin kerja bagi Warga Negara Asing\n\n2. Mobile Costumer Service\na. Tata Cara Pendaftaran\n Calon peserta mengunjungi\nMobile Customer Service (MCS) pada hari dan jam yang telah ditentukan, melengkapi persyaratan yang dibutuhkan,\nmengisi Formulir Daftar Isian Peserta (FDIP) dan menunggu antrian untuk mendapatkan\npelayanan.\n Setelah semua data lengkap,\npeserta akan mendapatkan nomor virtual account yang digunakan untuk melakukan\npembayaran iuran.\n Calon peserta dapat melakukan pembayaran iuran pertama dalam waktu paling\ncepat 14 (empat belas) hari atau paling lambat 30 (tiga puluh) hari setelah\npendaftaran.\n Setelah melakukan pembayaran, Kartu JKN-KIS diterima peserta.\nb. Persyaratan:\n Formulir daftar isian peserta (Dapat diambil / diisi di Kantor\nCabang)\n Asli KTP\n Asli Kartu Keluarga\n Memiliki Nomor Handphone\n Memiliki Email\n Fotokopi nomor rekening bank\npada buku tabungan\n Surat Kuasa autodebet\n pembayaran iuran bagi yang\nmemilih kelas perawatan I dan II\nPembayaran iuran melalui autodebet\nFotokopi paspor dan surat izin\nkerja bagi Warga Negara Asing\n\n3. Care Center 165\na. Tata Cara Pendaftaran\n Hubungi BPJS Kesehatan Care\nCenter 165, ikuti petunjuknya sesuai dengan instruksi operator Care Center dan\nlengkapi persyaratan yang dbutuhkan.\n Setelah semua data lengkap, konfirmasi pendaftaran dan nomor virtual account yang\ndigunakan untuk melakukan pembayaran iuran dan akan dikirim melalui email/SMS.  Calon peserta dapat melakukan pembayaran iuran pertama dalam waktu paling\ncepat 14 (empat belas) hari atau paling lambat 30 (tiga puluh) hari setelah pendaftaran.\n Setelah melakukan pembayaran, Kartu JKN-KIS diterima peserta.\nb. Persyaratan :\n Nomor Handphone\n Alamat Email\n Pembayaran luran Melalui\nAutodebet\n\n4. Dropbox Kantor Kecamatan atau Kelurahan yang bekerjasama a. Tata Cara Pendaftaran\n Calon peserta mendatangi Kecamatan atau kelurahan yang telah bekerjasama dengan BPJS Kesehatan dan\nmengisi Formulir Daftar Isian Peserta.\n Setelah data lengkap, berkas dimasukkan ke dalam dropbox yang tersedia di Kecamatan atau Kelurahan\n Secara periodik petugas BPJS\nKesehatan akan mengambil berkas tersebut, dan berkas\nakan di-entry oleh petugas\nBPJS Kesehatan di Kantor BPJS Kesehatan.\n Calon peserta akan menerima\nnomor virtual account yang digunakan untuk pembayaran iuran pertama yang akan dikirim melalui SMS.\n Calon peserta dapat melakukan pembayaran iuran pertama dalam waktu paling\ncepat 14 (empat belas) hari\natau paling lambat 30 (tiga puluh) hari setelah pendaftaran.\n Setelah melakukan pembayaran, Kartu JKN-KIS diterima peserta. b. Persyaratan Non Dropbox\n Menandatangani Daftar Isian Luaran Aplikasi\n Asli KTP\n Nomor Handphone\n Surat Kuasa autodebetpembayaran iuran\nbagi yang memilih kelas perawatan I dan II\nc. Persyaratan Dropbox\n Formulir daftar isian peserta\n\nFotokopi Kartu Keluarga  Nomor Handphone\n Surat Kuasa\nautodebetpembayaran iuran\nbagi yang memilih kelas\nperawatan I dan II\n\n5. Aplikasi Mobile JKN\na. Unduh aplikasi Mobile JKN di Appstore atau Google Play Store. Pilih menu Pendaftaran Peserta Baru dan pilih persetujuan untuk\nmematuhi syarat dan ketentuan yang berlaku.\nb. Siapkan kelengkapan data: Nomor Induk Kependudukan (NIK), Kartu Keluarga dan Nomor\nRekening Bank (jika memilih kelas perawatan I/II). c. Isi data sesuai dengan ketentuan\ndalam Aplikasi Mobile JKN diantaranya nama lengkap, tempat lahir, tanggal lahir, status pernikahan, alamat/domisili, pilih Kelas Perawatan (I, II atau III), pilih FKTP terdekat, nomor handphone dan email yang aktif dan nomor rekening Bank.\nd. Setelah semua data lengkap, konfirmasi pendaftaran dan nomor virtual account yang\ndigunakan untuk melakukan pembayaran iuran dan akan dikirim melalui email/SMS. e. Calon peserta dapat melakukan pembayaran iuran pertama\ndalam waktu paling cepat 14\n(empat belas) hari atau paling\nlambat 30 (tiga puluh) hari setelah pendaftaran. f. Setelah melakukan pembayaran, Kartu JKN-KIS diterima peserta.\n\n6. Website BPJS Kesehatan\na. Masuk ke Website BPJS\nKesehatan: www.bpjs-\nkesehatan.go.id, pilih menu\nLayanan pilih Pendaftaran\nPeserta dan centang persetujuan\nuntuk menerima dan menyetujui\nsyarat dan ketentuan layanan pendaftaran BPJS Kesehatan, lalu isi data sesuai dengan ketentuan.\nb. Setelah data lengkap, calon peserta akan menerima konfirmasi pendaftaran dan nomor virtual account yang akan\ndikirim melalui email yang\ndidaftarkan.\nc. Calon peserta dapat melakukan pembayaran iuran pertama dalam waktu paling cepat 14\n(empat belas) hari atau paling\nlambat 30 (tiga puluh) hari setelah pendaftaran. d. Setelah pembayaran, buka\nkembali halaman Aktivasi\nuntuk\nmembuka link pencetakan e-ID BPJS Kesehatan.\n\n7. Mall Pelayanan Publik\na. Calon peserta mengunjungi Mall\nPelayanan Publik, melengkapi\npersyaratan yang dibutuhkan,\nmengisi Formulir Daftar Isian Peserta (FDIP) dan menunggu antrian untuk mendapatkan pelayanan.\nb. Setelah data lengkap, calon\npeserta akan menerima nomor\nvirtual account yang digunakan untuk pembayaran iuran pertama\nyang akan dikirim melalui SMS\nc. Calon peserta dapat melakukan\npembayaran iuran pertama dalam waktu paling cepat 14 (empat belas) hari atau paling\nlambat 30 (tiga puluh) hari setelah pendaftaran. d. Setelah melakukan pembayaran,\nKartu JKN-KIS diterima peserta.\n\n8. Mall Bank, PPOB dan agen mitra lainnya yang bekerjasama\na. Calon peserta mendatangi Bank/PPOB/Mitra lainnya yang telah bekerjasama Kesehatan dan mengisi Formulir\ndengan BPJS\nDaftar Isian Peserta (FDIP).\nb. Setelah data lengkap, calon\npeserta akan menerima nomor\nvirtual account yang digunakan untuk pembayaran iuran pertama\nyang akan dikirim melalui SMS\nc. Calon peserta dapat melakukan\npembayaran iuran pertama dalam waktu paling cepat 14 (empat belas) hari atau paling\nlambat 30 (tiga puluh) hari setelah pendaftaran. d. Setelah melakukan pembayaran,\nKartu JKN-KIS diterima peserta.\nCalon peserta dapat melakukan\npembayaran iuran pertama dalam waktu paling cepat 14 (empat belas)\nhari atau paling lambat 30 (tiga\npuluh) hari setelah pendaftaran. Pendaftaran PBPU/BP Kolektif dimungkinkan untuk Mahasiswa dari\nPerguruan tinggi atau lembaga\nsejenis, Siswa/santri dari\nSekolah/Pesantren atau lembaga sejenis, Saksi dan Korban dalam Perlindungan Lembaga Hukum,\nPenghuni Lembaga Permasyarakatan Negara, Panti Sosial, Lembaga atau\nBadan Amal, Lembaga/Yayasan atau\nBadan Sosial, Koperasi Berbadan Hukum serta Program CSR Badan\nUsaha.'),
(6, 'Pendaftaran', 'Peserta Bukan Pekerja (BP) Penyelenggara Negara', 'Pendaftaran dapat dilakukan secara perorangan maupun kolektif dengan cara mengisi Formulir Daftar Isian\nPeserta (FDIP) beserta\npersyaratannya.\nA. Persyaratan :\n1. PP Pejabat Negara\n Asli KTP\n Fotokopi Kartu Keluarga\n Asli/Fotokopi surat tanda bukti\npenerima pensiun atau KARIP  Asli/Fotokopi surat tanda bukti penerima pensiun atau Kartu Tanda Peserta ASABRI\n Asli/Fotokopi Surat Keputusan\nJanda/Duda/Anak Yatim/Anak Piatu dan atau Anak Yatim\nPiatu\n Surat Keterangan dari\nsekolah/Perguruan Tinggi (bagi anak berusia lebih dari 21 (dua\npuluh satu) tahun sampai\ndengan 25 (dua puluh lima) tahun\n2. PP PNSPusat/Daerah\n Asli KTP\n Fotokopi Kartu Keluarga\n Asli/Fotokopi surat tanda bukti\n\npenerima pensiun atau KARIP\nAsli/Fotokopi surat tanda bukti\npenerima pensiun atau Kartu\nTanda Peserta ASABRI\n Asli/Fotokopi Surat Keputusan\nJanda/Duda/Anak Yatim/Anak Piatu dan atau Anak Yatim\nPiatu\n Surat Keterangan dari\nsekolah/Perguruan Tinggi (bagi\nanak berusia lebih dari 21 (dua\npuluh satu) tahun sampai\ndengan 25 (dua puluh lima)\ntahun\n3. PP TNI\n Asli KTP\n Fotokopi Kartu Keluarga  Asli/Fotokopi surat tanda bukti\npenerima pensiun atau KARIP  Asli/Fotokopi surat tanda bukti penerima pensiun atau Kartu Tanda Peserta ASABRI\nAsli/Fotokopi Surat Keputusan\nJanda/Duda/Anak Yatim/Anak Piatu dan atau Anak Yatim\nPiatu\n Surat Keterangan dari\nsekolah/Perguruan Tinggi (bagi\nanak berusia lebih dari 21 (dua\npuluh satu) tahun sampai dengan 25 (dua puluh lima)\ntahun\n4. PP POLRI\n Asli KTP\n Fotokopi Kartu Keluarga\n\nAsli/Fotokopi surat tanda bukti\n\npenerima pensiun atau KARIP\nAsli/Fotokopi surat tanda bukti\npenerima pensiun atau Kartu Tanda Peserta ASABRI\n Asli/Fotokopi Surat Keputusan Janda/Duda/Anak Yatim/Anak Piatu dan atau Anak Yatim\nPiatu\n Surat Keterangan dari sekolah/Perguruan Tinggi (bagi anak berusia lebih dari 21 (dua\npuluh satu) tahun sampai dengan 25 (dua puluh lima)\ntahun\n5. Perintis Kemerdekaan\n Asli KTP\n Fotokopi Kartu Keluarga\n Asli/Fotokopi surat tanda bukti penerima pensiun atau KARIP  Asli/Fotokopi piagam petikan SK Pengesahan Gelar Kehormatan Veteran RI\nAsli/Fotokopi Surat Keputusan\nJanda/Duda/Anak Yatim/Anak Piatu dan atau Anak Yatim\nPiatu\n Surat Keterangan dari sekolah/Perguruan Tinggi (bagi\nanak berusia lebih dari 21 (dua puluh satu) tahun sampai dengan 25 (dua puluh lima)\ntahun\n6. Veteran\n Asli KTP\n Fotokopi Kartu Keluarga\n Asli/Fotokopi surat tanda bukti\n\npenerima pensiun atau KARIP Asli/Fotokopi piagam petikan\nSK Pengesahan Gelar Kehormatan Veteran RI\n Asli/Fotokopi Surat Keputusan Janda/Duda/Anak Yatim/Anak Piatu dan atau Anak Yatim\nPiatu\n Surat Keterangan dari sekolah/Perguruan Tinggi (bagi anak berusia lebih dari 21 (dua puluh satu) tahun sampai dengan 25 (dua puluh lima) tahun\nB. Kanal Layanan Pendaftaran 1. Mobile Customer Service (MCS) Peserta mengunjungi Mobile Customer Service (MCS) pada\nhari dan jam yang telah ditentukan, melengkapi persyaratan yang dibutuhkan, mengisi Formulir Daftar Isian\nPeserta (FDIP) dan menunggu\nantrian untuk mendapatkan pelayanan. 2. Mall Pelayanan Publik\nPeserta mengunjungi Mall\nPelayanan Publik, melengkapi persyaratan yang dibutuhkan,\nmengisi Formulir Daftar Isian\nPeserta (FDIP) dan menunggu\nantrian untuk mendapatkan pelayanan.\n3. Kantor Cabang dan Kantor Kabupaten/Kota Peserta mengunjungi Kantor Cabang atau Kantor Kabupaten/Kota, mengambil\nnomor antrian pelayanan korporasi, melengkapi persyaratan yang dibutuhkan,\nmengisi Formulir Daftar Isian Peserta (FDIP) dan menunggu antrian untuk mendapatkan pelayanan.'),
(7, 'Pendaftaran', 'Enter your name', 'name'),
(8, 'Hak & Kewajiban', 'Hak & Kewajiban', '1. Hak Peserta\n Mendapatkan kartu identitas peserta sebagai identitas peserta JKN-KIS untuk memperoleh pelayanan\nkesehatan.\n Memperoleh manfaat dan informasi tentang hak dan kewajiban serta prosedur pelayanan kesehatan sesuai dengan ketentuan yang berlaku.  Mendapatkan pelayanan kesehatan di fasilitas kesehatan yang bekerja\nsama dengan BPJS Kesehatan.\n Menyampaikan pengaduan, kritik dan saran secara lisan maupun tertulis kepada BPJS Kesehatan.\n2. Kewajiban Peserta\n Mendaftarkan diri dan anggota\nkeluarganya sebagai peserta JKN-KIS kepada BPJS Kesehatan.\n Membayar iuran secara rutin setiap bulan sebelum tanggal 10 (sepuluh).  Memberikan data dirinya dan anggota keluarganya secara lengkap dan\nbenar.\n Melaporkan perubahan data dirinya dan anggota keluarganya, antara lain perubahan golongan, pangkat atau besaran gaji, pernikahan, perceraian, kematian, kelahiran, pindah alamat/domisili dan pindah fasilitas kesehatan tingkat pertama serta perubahan alamat email dan nomor handphone\n Menjaga kartu peserta agar tidak rusak, hilang atau dimanfaatkan oleh orang yang tidak berhak.\n Mentaati semua ketentuan dan tata\ncara pelayanan kesehatan.\n3. Kewajiban Pemberi Kerja\n Mendaftarkan dirinya dan pekerjanya sebagai Peserta Jaminan Kesehatan kepada BPJS Kesehatan.\n Menghitung dan memungut iuran yang menjadi kewajiban peserta dari pekerjanya melalui pemotongan\ngaji/upah pekerja.\n Membayar dan menyetorkan iuran yang menjadi tanggung jawabnya\nkepada BPJS Kesehatan\n Memberikan data mengenai dirinya,\npekerjaannya dan anggota\nkeluarganya secara lengkap dan\nbenar meliputi :\na. Data pekerja berikut anggota\nkeluarganya yang didaftarkan\nsesuai dengan data pekerja yang\ndipekerjakan dengan\nmencantumkan Nomor Induk\nKependudukan (NIK) KTP\nElektronik;\nb. Data upah (Gaji pokok + Tunjangan\nTetap) yang dilaporkan sesuai\ndengan upah yang diterima pekerja\nPerubahan data badan usaha atau badan\nhukum, meliputi: alamat perusahaan, kepengurusan perusahaan, jenis badan\nusaha, jumlah pekerja, data pekerja dan keluarganya serta perubahan besarnya upah setiap pekerja, selambatnya 7 (tujuh) hari setelah terjadi perubahan.'),
(9, 'Sanksi', 'Sanksi', 'SANKSI\nBerdasarkan Undang  Undang Nomor 24 Tahun 2011, BPJS diberikan kewenangan untuk melakukan pengawasan dan pemeriksaan serta pengenaan sanksi administratif bagi pemberi kerja ataupun perseorangan yang tidak melaksanakan kewajibannya dalam sistem jaminan sosial sebagaimana diatur peraturan perundang-undangan.\nA. Sanksi atas ketidakpatuhan dalam Kewajiban Pendaftaran.\nKetidakpatuhan pemberi kerja selain\npenyelenggara negara dalam\nmelakukan pendaftaran.\n1. Pengenaan sanksi administratif oleh BPJS Kesehatan dilakukan setelah\ndilaksanakan\n Teguran tertulis, diberikan paling banyak 2 (dua) kali masing  masing untuk jangka waktu paling lama 10 (sepuluh) hari kerja.\n Denda sebesar 0,1% diberikan\nuntuk jangka waktu paling lama 30 hari sejak berakhirnya pengenaan\nsanksi teguran tertulis kedua.\n Tidak mendapat pelayanan publik\ntertentu.\n2. Apabila pemberi kerja selain\npenyelenggara negara tidak\nmelaksanakan kewajiban pendaftaran\nsetelah dilaksanakan sanksi\nadministratif berupa teguran dan\ndenda, BPJS kesehatan mengusulkan\nsanksi administratif tidak mendapatkan pelayanan publik\ntertentu kepada pemerintah atau pemerintah daerah. yang berupa :\n Perizinan terkait usaha\n Izin yang diperlukan dalam mengikuti tender proyek\n Izin mempekerjakan tenaga asing  Izin perusahaan penyedia jasa pekerja/buruh atau\n Izin medirikan bangunan\n3. Ketidakpatuhan setiap orang selain pemberi kerja, pekerja penerima upah dan penerima bantuan iuran dalam melakukan pendaftaran.\n Setiap orang selain pemberi kerja, pekerja dan penerima bantuan iuran yang tidak melakukan pendaftaran dirinya dan anggota keluarga akan dikenai sanksi administratif tidak mendapatkan pelayanan publik tertentu.\n Sanksi tersebut dikenakan dengan\ncara mensyaratkan kepesertaan BPJS Kesehatan dalam\nmemperoleh pelayanan publik\ntertentu berupa :\na. Izin Mendirikan Bangunan (IMB)\nb. Surat Ijin Mengemudi (SIM)\nc. Sertifikat tanah\nd. Paspor, atau\ne. Surat Tanda Nomor Kendaraan\n(STNK).\nB. Sanksi atas ketidakpatuhan dalam\npeyampaian perubahan data dan memberikan data secara lengkap dan\nbenar.\n1. Kewajiban memberikan data secara lengkap dan benar\na. Pemberi kerja selain penyelenggara\nnegara wajib memberikan data\ndirinya dan pekerjanya berikut anggota keluarga kepada BPJS Kesehatan secara lengkap dan benar. Penyampaian data diri dan\npekerjanya dan perubahan data secara lengkap dan benar, berupa :  Data pekerja berikut anggota\nkeluarganya yang didaftarkan sesuai dengan data pekerja yang dipekerjakan\n Data upah yang dilaporkan sesuai\ndengan upah yang diterima\nperkerja\n Data kepesertaan dalam program jaminan sosial sesuai penahapan kepesertaan, dan\n Perubahan data ketenagakerjaan\npaling sedikit meliputi :\ni. Alamat perusahaan ii. Kepemilikan perusahaan\niii. Kepengurusan perusahaan\niv. Jenis badan usaha v. Jumlah pekerja\nvi. Data pekerja dan keluarganya\nvii. Perubahan besarnya upah setiap pekerja\nviii. Perubahan data sebagaimana disebutkan diatas dilaporkan oleh Pemberi Kerja Selain Penyelenggara Negara kepada BPJS Kesehatan paling lambat\n7 (tujuh) hari sejak terjadinya perubahan.\nb. Setiap orang, selain pemberi kerja,\npekerja dan penerima bantuan iuran yang memenuhi ketentuan perundang-undangan wajib\nmemberikan data dirinya dan anggota keluarganya secara lengkap dan benar kepada BPJS Kesehatan. Penyampaian data diri dan anggota keluarganya secara\nlengkap dan benar berupa :  Data anggota keluarga yang didaftarkan harus sesuai dengan data yang sebenarnya\n Perubahan data dirinya dan\nanggota keluarganya paling sedikit meliputi :\ni. Alamat\nrumah\nii. Jenis Pekerjaan iii. Jumlah Anggota Keluarga\niv. Perubahan data sebagaimana disebutkan diatas wajib\ndilaporkan oleh setiap orang\nselain pemberi kerja, pekerja dan penerima bantuan iuran kepada BPJS Kesehatan paling\nlambat 7 (tujuh) hari sejak terjadinya perubahan.\n2. Sanksi atas ketidak patuhan dalam penyampaian perubahan data dan\nmemberikan data secara lengkap dan benar\na. Pemberi kerja selain penyelenggara negara yang tidak memberikan data\nsecara lengkap dan benar dari dirinya dan pekerjanya berikut anggota keluarga akan dikenakan sanksi administratif\nb. Sanksi administratif akan\ndikenakan oleh BPJS setelah dilaksanakan pemeriksaan kepada pemberi kerja\nc. Sanksi administrasi berupa :  Teguran Tertulis : Sanksi teguran\ntertulis diberikan paling banyak 2 (dua) kali masing-masing untuk jangka waktu paling lama 10 (sepuluh) hari kerja.\n Denda\n Tidak mendapat pelayanan publik\ntertentu\nd. Apabila pemberi kerja tidak melaksanakan kewajiban\nmemberikan data secara lengkap dan benar setelah dilaksanakan sanksi administratif berupa teguran dan denda, BPJS Kesehatan mengusulkan sanksi administratif tidak mendapat pelayanan publik\ntertentu kepada pemerintah atau pemerintah daerah.\ne. Sanksi tidak mendapat pelayanan\npublik bagi Pemberi Kerja Selain\nPenyelenggara Negara yang tidak melaksanakan kewajiban pendaftaran berupa :\n Perizinan terkait izin usaha\nIzin yang diperlukan dalam\nmengikuti tender proyek\n Izin mempekerjakan tenaga kerja\nasing\n Izin perusahaan penyedia jasa\npekerja/buruh, atau\n Izin mendirikan bangunan\nC. Sanksi atas kewajiban pembayaran iuran\n1. Kewajiban pembayaran iuran\n Pemberi kerja wajib memungut\niuran yang menjadi beban peserta dari pekerjanya dan menyetorkannya kepada BPJS\nKesehatan\n Pemberi kerja wajib membayar dan menyetor iuran yang menjadi\ntanggung jawabnya kepada BPJS\nKesehatan\n Peserta yang bukan pekerja dan\nbukan Penerima Bantuan luran\nwajib membayar dan menyetor iuran yang menjadi tanggung jawabnya kepada BPJS Kesehatan. 2. Dalam hal keterlambatan pembayaran juran Jaminan Kesehatan lebih dari 1\n(satu) bulan sejak tanggal 10,\npenjaminan peserta diberhentikan sementara.\n3. Denda hanya berlaku bagi peserta yang memperoleh Pelayanan Rawat Inap dalam waktu 45 hari sejak status\nkepesertaan aktif kembali, yakni sebesar 5% dari biaya pelayanan kesehatan Rawat inap di kali lama\nbulan tertunggak dengan ketentuan :\n Jumlah bulan tertunggak maksimal\n12 bulan\n Besar denda paling tinggi Rp. 30.000.000\n4. Peraturan tentang denda mulai berlaku pada 01 Juli 2016 5. Pelaporan Ketidakpatuhan\nPembayaran luran\nBPJS Kesehatan dalam melaksanakan pengawasan dan pemeriksaan kepatuhan terhadap\npemberi kerja selain penyelenggara\nnegara dalam memenuhi kewajibannya dalam membayar iuran atau memenuhi kewajiban lain melaporkan tindakan\n6. Sanksi Pidana\nBerdasarkan ketentuan Pasal 55 Undang-Undang nomor 24 tahun\n2011, Pemberi Kerja yang tidak melaksanakan kewajiban\nsebagaimana pasal 19 UU No. 24\ntahun 2011 ayat 1 dan 2, dipidana dengan penjara paling lama 8 (delapan) tahun atau pidana denda paing banyak Rp. 1.000.000.000,- (Satu Milyar Rupiah).'),
(10, 'Fasilitas & Manfaat', 'Pelayanan Kesehatan', 'Prosedur Pelayanan Kesehatan\nTingkat Pertama\n Ketentuan Umum\n1. Setiap Peserta harus terdaftar pada satu fasilitas kesehatan\ntingkat pertama yang telah\nbekerja sama dengan BPJS\nKesehatan\n2. Peserta menunjukkan identitas\npeserta BPJS Kesehtan dan identitas kedua (KK/KTP/SIM) setiap kali memanfaatkan pelayanan kesehatan di fasilitas tingkat pertama 3. Peserta memperoleh\npelayanan kesehatan pada Fasilitas Kesehatan tingkat\npertama tempat Peserta\nterdaftar, kecuali pada kondisi:\n Berada di luar wilayah\nFasilitas Kesehatan tingkat\npertama tempat peserta\nterdaftar; atau\n Dalam keadaan\nkegawatdaruratan medis\n4. Peserta dianggap berada di luar wilayah apabila peserta melakukan kunjungan ke luar domisili karena tujuan tertentu, bukan merupakan kegiatan\nyang rutin.\n5. Dalam hal peserta memerlukan pelayanan kesehatan tingkat lanjutan, Fasilitas Kesehatan tingkat pertama harus merujuk ke Fasilitas Kesehatan rujukan tingkat lanjutan sesuai dengan sistem rujukan berjenjang 6. Peserta dapat melakukan pindah FKTP setelah 3 bulan\npeserta terdaftar pada Puskesmas/Dokter Keluarga/\nDokter Gigi sebelumnya\n7. Peserta yang melakukan\npindah FKTP pada tanggal 1 s/d akhir bulan berjalan, berhak\nmendapatkan pelayanan di\nfasilitas kesehatan tingkat\npertama yang baru di bulan\nberikutnya\n8. Peserta perorangan BPJS\nKesehatan dapat memperoleh\npelayanan di fasilitas\nkesehatan tingkat pertama\nterdaftar sejak pembayaran\niuran yang pertama\n Rawat Jalan Tingkat Pertama\n1. Peserta menandatangani bukti pelayanan pada lembar yang\ndisediakan setelah\nmendapatkan pelayanan\nkesehatan\n2. Bila hasil pemeriksaan dokter ternyata peserta memerlukan pemeriksaan ataupun tindakan spesialis/sub-spesialis sesuai\ndengan indikasi medis, maka\nfasilitas kesehatan tingkat\npertama akan memeberikan surat rujukan untuk dibawa ke\nfasilitas kesehatan rujukan tingkat lanjutan yang bekerja\nsama dengan BPJS Kesehatan sesuai dengan sistem rujukan yang berlaku\n Rawat Inap Tingkat Pertama\n1. Peserta menandatangani bukti pelayanan pada lembar yang disediakan setelah mendapatkan pelayanan\nkesehatan\n2. Bila hasil pemeriksaan dokter ternyata peserta memerlukan pemeriksaan ataupun tindakan spesialis/sub-spesialis sesuai dengan indikasi medis, maka\nfasilitas kesehatan tingkat\npertama akan memeberikan\nsurat rujukan untuk dibawa ke fasilitas kesehatan rujukan tingkat lanjutan yang bekerja\nsama dengan BPJS Kesehatan\nsesuai dengan sistem rujukan yang berlaku\nProsedur Pelayanan Gawat Darurat\nPelayanan gawat darurat adalah\npelayanan kesehatan yang harus\ndiberikan secepatnya untuk\nmencegah kematian, keparahan\ndan/atau kecacatan, sesuai dengan kemampuan fasilitas kesehatan\n Dalam keadaan gawat darurat, maka:\n1. Pelayanan harus segera\ndiberikan tanpa diperlukan surat rujukan 2. Peserta yang mendapat pelayanan di Fasilitas\nKesehatan yang tidak bekerja sama dengan BPJS Kesehatan\nharus segera dirujuk ke Fasilitas Kesehatan yang bekerja sama dengan BPJS\nKesehatan setelah keadaan\ndaruratnya teratasi dan pasien\ndalam kondisi dapat dipindahkan\n3. Fasilitas kesehatan tidak\ndiperkenanakan menarik biaya pelayanan kesehatan kepada\npeserta\n Prosedur Pelayanan Gawat\nDarurat di Fasilitas Kesehatan yang Bekerjasama dengan BPJS Kesehatan:\n1. Pelayanan kegawatdaruratan di Fasilitas Kesehatan Tingkat Pertama dapat diberikan pada Fasilitas Kesehatan tempat\npeserta terdaftar maupun bukan tempat peserta terdaftar 2. Pelayanan kegawatdaruratan di Fasilitas Kesehatan Tingkat\nPertama maupun lanjutan mengikuti prosedur pelayanan yang berlaku\n Prosedur Pelayanan Gawat Darurat di Fasilitas Kesehatan\nTingkat Pertama dan Fasilitas\nKesehatan Rujukan Tingkat Lanjutan yang tidak bekerjasama dengan BPJS Kesehatan\n1. Peserta mendapatkan pelayanan kesehatan di\nfasilitas kesehatan 2. Apabila kondisi kegawatdaruratan pasien\nsudah teratasi dan pasien\ndalam kondisi dapat dipindahkan, maka\nfasilitas\nkesehatan merujuk pasien ke\nfasilitas kesehatan yang bekerja sama dengan BPJS\nKesehatan\n3. Apabila Peserta tidak bersedia untuk dirujuk ke Fasilitas Kesehatan yang bekerja sama\ndengan BPJS Kesehatan maka biaya pelayanan selanjutnya tidak dijamin oleh BPJS\nKesehatan dan peserta harus menandatangani surat\npernyataan bersedia\nmenanggung biaya pelayanan\nselanjutnya\n4. Peserta dari UGD dapat melanjutkan pelayanan\nrawatinap di Fasilitas\nKesehatan yang tidak bekerjasama dengan ketentuan\nsebagai berikut:\nTidak ada sarana transportasi untuk evakuasi\npasien\n Sarana transportasi yang tersedia tidak memenuhi syarat untuk evakuasi\nKondisi Peserta yang tidak memungkinkan secara\nmedis untuk dievakuasi, yang dibuktikan dengan surat keterangan medis dari dokter yang merawat\nProsedur Pelayanan Ambulan\nDalam rangka evakuasi Peserta, maka:\n1. Fasilitas kesehatan yang\nmemiliki fasilitas ambulan dapat langsung memberikan pelayanan ambulan bagi pasien\n2. Fasilitas kesehatan yang tidak\nmemiliki fasilitas ambulan, maka\nFasilitas Kesehatan\nberkoordinasi dengan penyedia ambulan\n3. Proses rujukan antar Fasilitas kesehatan mengikuti ketentuan sistem rujukan berjenjang yang berlaku'),
(11, 'Fasilitas & Manfaat', 'Pelayanan Kesehatan yang dijamin', ' Pelayanan Kesehatan Tingkat\nPertama\n1. Rawat Jalan Tingkat Pertama,\nmeliputi:\n Administrasi pelayanan  Pelayanan promotif dan\npreventif\n Pemeriksaan, pengobatan,\ndan konsultasi medis\n Tindakan medis non\nspesialistik, baik operatif\nmaupun non operatif\n Pelayanan obat dan bahan\nmedis habis pakai\n Pemeriksaan penunjang diagnostik laboratorium\ntingkat pertama\n Pemeriksaan ibu hamil, nifas,\nibu menyusui dan bayi\nUpaya penyembuhan\nterhadap efek samping\nkontrasepsi termasuk\npenanganan komplikasi KB\npaska persalinan\n Rehabilitasi medik dasar\n2. Pelayanan Gigi\n3. Rawat Inap Tingkat Pertama\nsesuai indikasi medis\n4. Pelayanan darah sesuai\nindikasi medis\n Pelayanan kesehatan rujukan\ntingkat lanjutan, meliputi\npelayanan kesehatan rawat jalan dan rawat inap, yang mencakup:\n1. Administrasi pelayanan\n2. Pemeriksaan, pengobatan, dan konsultasi spesialistik oleh dokter spesialis dan\nsubspesialistik\n3. Tindakan medis spesialistik,\nbaik operatif (bedah) maupun\nnon operatif sesuai dengan\nindikasi medis\n4. Pelayanan obat dan bahan\nmedis habis pakai\n5. Pelayanan alat kesehatan 6. Pemeriksaan penunjang diagnostik lanjutan sesuai dengan indikasi medis\n7. Rehabilitasi medik\n8. Pelayanan darah\n9. Pelayanan kedokteran forensik\nklinik maliputi pembuatan\nvisum et repertum atau surat keterangan medik berdasarkan pemeriksaan forensik orang hidup dan pemeriksaan\npsikiatri forensik\n10. Pelayanan jenazah terbatas\nhanya bagi peserta meninggal\ndunia pasca rawat inap di Fasilitas Kesehatan yang\nbekerjasama dengan BPJS\ntempat pasien dirawat berupa\npemulasaran jenasah dan tidak\ntermasuk petimati, kain kafan/perlengkapan jenazah\ndan mobil jenazah\n Pelayanan Persalinan dan\nNeonatal\n1. Cakupan pelayanan kebidanan\ndan neonatal meiputi\npelayanan pemeriksaan\nkehamilan, persalinan,\npemeriksaan pasca persalinan\ndan bayi baru lahir, serta\npelayanan KB\n2. Persalinan yang dijamin oleh\nBPJS Kesehatan tidak\nmembatasi jumlah kehamilan/persalinan\n3. Pelayanan persalinan ditagihkan oleh Fasilitas\nKesehatan yang memberikan pelayanan\n4. Pelayanan kebidanan dan\nneonatal dilayani di FKTP dan dapat dirujuk ke FKRTL atas indikasi medis\n Pelayanan Gawat Darurat Pelayanan gawat darurat yang dapat dijamin adalah sesuai dengan kriteria gawat darurat yang berlaku\n Pelayanan Ambulan\nPelayanan Ambulan diberikan pada transportasi darat dan air, bagi Peserta dengan kondisi tertentu antar Fasilitas Kesehatan, disertai dengan\nupaya atau kegiatan menjaga\nkestabilan kondisi pasien dengan\ntujuan penyelamatan nyawa Peserta sesuai ketentuan\nperaturan perundang-undangan Pelayanan Ambulan yang dijamin\nadalah pelayanan yang sesuai ketentuan sebagai berikut:\n1. Kriteria kondisi tertentu adalah:\n Kondisi Peserta sesuai\nindikasi medis berdasarkan rekoemndasai medis dari dokter yang merawat\n Peserta rujukan kasus gawat darurat dari failitas\nkesehatan yang tidak bekerjasama dengan tujuan\nperawatan sampai dengan kondisi kegawatdaruratan telah teratasi dan dapat\ndipindahkan ke fasilitas kesehatan yang bekerjsama\n peserta rujuk balik rawat inap yang masih memerlukan pelayanan rawat inap di\nFasilitas kesehatan semula\n2. Pelayanan ambulan hanya\ndiberikan untuk rujukan antar Faskes:\n Antar faskes tingkat pertama\n Dari Faskes tingkat pertama ke faskes rujukan\n Antar faskes rujukan sekunder\n Dari Faskes rujukan sekunder\nke faskes tersier\n Antar faskes tersier\n Dan rujukan balik ke faskes dengan tipe dibawahnya\n3. Pelayanan Ambulan yang tidak dijamin adalah pelayanan yang tidak sesuai ketentuan di atas, berikut:\n Jemput Peserta selain dari\nFasilitas Kesehatan (rumah, jalan, lokasi lain)\n Mengantar Peserta ke selain Fasilitas kesehatan\n Rujukan parsial (antar jemput Peserta atau spesimen\ndalam rangka mendapatkan pemeriksaan penunjang atau tindakan, yang merupakan rangkaian perawatan pasien di salah satu Fasilitas Kesehatan)\n Ambulan/mobil jenazah  Pasien rujuk balik rawat jalan'),
(12, 'Fasilitas & Manfaat', 'Fasilitas Kesehatan', 'Fasilitas kesehatan yang bekerjasama dengan BPJS Kesehatan terdiri dari:\n Fasilitas Kesehatan Tingkat Pertama (FKTP), meliputi\n Puskesmas atau yang setara  Dokter Umum Praktik Perorangan  Dokter Gigi praktek perorangan  Klinik Pratama atau yang setara termasuk failitas kesehatan\ntingkat pertama milik TNI/Polri  Rumah Sakit Kelas D Pratama atau yang setara\n Fasilitas Kesehatan Rujukan Tingkat Lanjutan (FKRTL), meliputi:\n Klinik Utama atau yang setara\n Balai Kesehatan\n Rumah Sakit Umum\n Rumah Sakit Khusus\n Fasilitas Kesehatan Penunjang,\nmeliputi:\n Laboratorium Kesehatan\n Apotek\n Optik'),
(13, 'Fasilitas & Manfaat', 'Hak Kelas Rawat Inap di Fasilitas Tingkat Lanjutan', ' Ruang perawatan kelas III bagi: 1. Peserta PBI Jaminan Kesehatan;\ndan\n2. Peserta Pekerja Bukan Penerima Upah dan Peserta bukan Pekerja dengan iuran untuk Manfaat pelayanan di ruang perawatan kelas III\nRuang perawatan kelas II bagi: 1. Pegawai Negeri Sipil dan penerima pensiun Pegawai Negeri Sipil golongan ruang I dan golongan ruang II beserta\nkeluarganya\n2. Anggota TNI dan penerima\npensiun Anggota TNI yang setara\nPegawai Negeri Sipil golongan\nruang I dan golongan ruang II\nbeserta keluarganya\n3. Anggota Polri dan penerima pensiun Anggota Polri yang\nsetara Pegawai Negeri Sipil golongan ruang I dan golongan ruang II beserta keluarganya 4. Peserta Pekerja Penerima Upah dan Pegawai Pemerintah Non Pegawai Negeri dengan gaji atau upah sampai dengan 1,5 (satu setengah) kali penghasilan tidak kena pajak dengan status kawin dengan 1 anak, beserta anggota keluarganya\n5. Peserta Pekerja Bukan Penerima\nUpah dan Peserta bukan Pekerja\ndengan iuran untuk Manfaat\npelayanan di ruang perawatan\nkelas II\n\nRuang perawatan kelas I bagi:\n1. Pejabat Negara dan anggota\nkeluarganya\n2. Pegawai Negeri Sipil dan\npenerima pensiun Pegawai Negeri Sipil golongan ruang III dan golongan ruang IV beserta keluarganya\n3. Anggota TNI dan penerima pensiun Anggota TNI yang setara\nPegawai Negeri Sipil golongan\nruang III dan golongan ruang IV\nbeserta keluarganya\n4. Anggota Polri dan penerima\npensiun Anggota Polri yang\nsetara Pegawai Negeri Sipil golongan ruang III dan golongan ruang IV beserta keluarganya 5. Veteran dan Perintis\nKemerdekaan beserta anggota keluarganya\n6. Janda, duda, atau anak yatim piatu dari Veteran atau Perintis Kemerdekaan\n7. Peserta Pekerja Penerima Upah dan Pegawai Pemerintah Non Pegawai Negeri dengan gaji atau upah sampai dengan 1,5 (satu setengah) sampai dengan 2 kali penghasilan tidak kena pajak dengan status kawin dengan 1 anak, beserta anggota\nkeluarganya\n8. Peserta Pekerja Bukan Penerima\nUpah dan Peserta bukan Pekerja\ndengan iuran untuk Manfaat pelayanan di ruang perawatan\nkelas I'),
(14, 'Cara Pembayaran', 'Pembayaran Premi BPJS Kesehatan', 'Pembayaran Premi BPJS Kesehatan semakin lebih mudah dengan banyaknya metode pembayaran yang telah disediakan. Silahkan pilih metode pembayaran yang nyaman bagi Anda.\n- mandr\n- BANK BRI\n- BNI\n- Bank BTN\n- tokopedia\n- Kartu Kredit\n- VISA\n- MasterCard\n- JCB'),
(15, 'FAQ', 'Siapa sajakah yang masuk dalam Anggota Keluarga', 'Anggota Keluarga adalah istri/suami yang sah, anak kandung, anak tiri dari perkawinan yang sah, dan anak angkat yang sah'),
(16, 'FAQ', 'Berapa besaran iuran PBI?', 'luran dibayarkan oleh pemerintah sebesar Rp. 42.000.00/orang/bulan'),
(17, 'FAQ', 'Apakah yang dimaksud Kartu Indonesia Sehat', 'Kartu Indonesia Sehat adalah tanda kepesertaan Jaminan Kesehatan Nasional (JKN) untuk memperoleh Pelayanan Kesehatan yang komprehensif pada Fasilitas Kesehatan.'),
(18, 'FAQ', 'Cara Melakukan Perubahan Domisili, Nomor Handphone dan Alamat Email', 'Perubahan domisili, nomor handphone dan alamat email diperlukan untuk kemudahan korespodensi maupun penyampaian informasi kepada peserta. Peserta melaporkan perubahan domisili, nomor handphone dan alamat email melalui kanal layanan yang disediakan oleh BPJS Kesehatan'),
(19, 'FAQ', 'Apa yang dimaksud dengan Upah atau Gaji', 'Upah atau gaji adalah hak Pekerja yang diterima dan dinyatakan dalam bentuk uang sebagai imbalan dari Pemberi Kerja kepada Pekerja yang ditetapkan dan dibayar menurut suatu perjanjian kerja, kesepakatan, atau peraturan perundang-undangan, termasuk tunjangan bagi Pekerja dan keluarganya atas suatu pekerjaan dan/atau jasa yang telah atau akan dilakukan'),
(20, 'FAQ', 'Apa yang dimaksud dengan Rawat Inap Tingkat Pertama', 'Yaitu pelayanan kesehatan perorangan yang bersifat non spesialistik dan dilaksanakan pada fasilitas kesehatan tingkat pertama untuk keperluan observasi, perawatan, diagnosis, pengobatan, dan/atau pelayanan medis lainnya, dimana peserta dan/atau anggota keluarganya dirawat inap paling singkat 1 (satu) hari'),
(21, 'FAQ', 'Syarat dan Cara Daftar Bayi Baru Lahir?', '1. Asli Kartu JKN-KIS Ibu Kandung\n 2. Asli/Fotocopy Surat keterangan lahir dari Dokter atau Bidan Puskesmas/Klinik/Rumah Sakit. \n3. Asli/Fotocopy Kartu Keluarga orang tua. \n4. Jika peserta belum melakukan autodebet tabungan dilengkapi dengan: a) Fotocopy buku rekening tabungan BNI/ BRI, Mandiri, BNI, BTN, BCA, Bank Jateng dan Bank Panin, dapat menggunakan rekening tabungan Kepala Keluarga/Anggota Keluarga dalam Kartu Keluarga/Penanggung b) Formulir autodebet pembayaran iuran BPJS Kesehatan bermaterai Rp6.000,00 (Enam ribu rupiah). \n5. Melakukan perubahan data bayi selambat-lambatnya 3 (tiga) bulan setelah kelahiran yang meliputi nama, tanggal lahir, jenis kelamin, dan NIK. \n6. Pendaftaran dilakukan melalui Rumah Sakit, Mobile Customer Service (MCS), Mall Pelayanan Publik dan Kantor Cabang dan Kantor Kabupaten/Kota'),
(22, 'FAQ', 'Apa Hak Peserta', '1. Mendapatkan kartu identitas peserta sebagai identitas peserta JKN-KIS untuk memperoleh pelayanan kesehatan. \n2. Memperoleh manfaat dan informasi tentang hak dan kewajiban serta prosedur pelayanan kesehatan sesuai dengan ketentuan yang berlaku. \n3. Mendapatkan pelayanan kesehatan di fasilitas kesehatan yang bekerja sama dengan BPJS Kesehatan. \n4. Menyampaikan pengaduan, kritik dan saran secara lisan maupun tertulis kepada BPJS Kesehatan.'),
(23, 'FAQ', 'Cara Melakukan Perubahan Tambah Peserta Dan Anggota Keluarga', 'Perubahan penambahan peserta dan anggota keluarga mengikuti mekanisme pendaftaran peserta baru sesuai dengan jenis kepesertaan, dengan syarat sebagai berikut: \n1. Kartu Keluarga \n2. Buku rekening tabungan BRI, Mandiri, BNI, BTN, dan BCA (dapat menggunakan rekening tabungan Kepala Keluarga/anggota keluarga dalam Kartu Keluarga/ penanggung). \n3. Formulir Autodebit pembayaran iuran BPJS Kesehatan bermaterai Rp.10.000,00 (Sepuluh Ribu Rupiah)'),
(24, 'FAQ', 'Siapa saja anggota keluarga yang ditanggung oleh Pekerja Penerima Upah?', 'Anggota keluarga meliputi istri/suami yang sah, anak kandung, anak tiri dari perkawinan yang sah, dan anak angkat yang sah, sebanyak-banyaknya 5 orang. Anak kandung, anak tiri dari perkawinan yang sah, dan anak angkat yang sah dengan kriteria: \na. Tidak atau belum pernah menikah atau tidak mempunyai penghasilan sendiri; dan \nb. Belum berusia 21 tahun atau belum berusia 25 tahun yang masih melanjutkan pendidikan formal. Anggota keluarga lain meliputi anak ke 4 dan seterusnya, ayah, ibu, dan mertua.'),
(25, 'FAQ', 'Bagaimana Jika Kartu Peserta Hilang', 'Peserta mengunjungi kantor BPJS Kesehatan/Mobile Customer Service (MCS)/Mall pelayanan publik dengan ketentuan: \n1. Menunjukkan KTP atau Kartu Keluarga yang berlaku. \n2. Surat pernyataan kehilangan yang ditanda tangani oleh peserta ber materai Rp6.000,00 (enam ribu rupiah) atau surat keterangan kehilangan dari Kepolisian. \n3. Pengurusan kartu peserta hilang dapat dilakukan oleh keluarga yang namanya tercantum dalam Kartu Keluarga. \n4. Jika dalam satu Kartu Keluarga peserta memiliki keterbatasan fi'),
(26, 'FAQ', 'Aplikasi Mobile JKN', 'Aplikasi Mobile JKN merupakan inovasi untuk kemudahan calon peserta atau peserta JKN-KIS, dengan memanfaatkan teknologi informasi yang dapat diunduh melalui aplikasi Mobile JKN di Google Playstore atau Apps Store. \n1. 5 Kemudahan menggunakan Aplikasi Mobile JKN: \na. Kemudahan mendaftar dan mengubah data kepesertaan. \nb. Kemudahan mengetahui informasi data peserta dan keluarga. \nc. Kemudahan mengetahui informasi tagihan dan pembayaran iuran. \nd. Kemudahan mendapatkan pelayanan di Faskes. \ne. Kemudahan'),
(27, 'FAQ', 'Apa yang dimaksud dengan Pelayanan Kesehatan Tingkat Pertama', 'Yaitu pelayanan kesehatan perorangan yang bersifat non spesialistik (primer) meliputi pelayanan rawat jalan dan rawat inap'),
(28, 'FAQ', 'Cara Mendaftar Menjadi Peserta PBI APBD', 'Pendaftaran dilakukan melalui pendataan oleh Pemerintah Daerah, yang selanjutnya didaftarkan kepada BPJS Kesehatan sesuai dengan perjanijian kerjasama antara Pemerintah Kabupaten/Kota dengan BPJS Kesehatan'),
(29, 'FAQ', 'Cara Melakukan Perubahan Data Kependudukan', 'Perubahan data kependudukan pada identitas peserta JKN-KIS yang meliputi data NIK, Nama, Tanggal Lahir dan Jenis Kelamin. Peserta melaporkan data kependudukan melalui kanal layanan yang disediakan oleh BPJS Kesehatan, dengan persyaratan: \na. Kartu Keluarga dan KTP \nb. Kartu Identitas Peserta JKN-KIS'),
(30, 'FAQ', 'Bagaimana cara pendaftaran Peserta Pekerja Penerima Upah', 'Pekerja Penerima Upah di daftarkan oleh perusahaan atau badan atau instansi tempat dia bekerja.'),
(31, 'FAQ', 'Apa yang dimaksud dengan Virtual Account', 'Virtual Account adalah nomor rekening virtual yang disediakan oleh BPJS Kesehatan untuk entitas dan perorangan sebagai rekening tujuan dalam pembayaran iuran jaminan kesehatan'),
(32, 'FAQ', 'Apakah yang dimaksud dengan anggota keluarga yang lain bagi Peserta Pekerja Bukan Penerima Upah', 'Anggota keluarga yang lain yang tercantum dalam Kartu Keluarga dan didaftarkan menjadi Peserta Pekerja Bukan Penerima Upah atau Bukan Pekerja'),
(33, 'FAQ', 'Cara Mendaftar Menjadi Peserta PBI APBN', 'Pendaftaran dilakukan melalui pendataan oleh Kementerian Sosial/Dinas Sosial Kabupaten/Kota. yang selanjutnya ditetapkan melalui Keputusan Menteri Sosial dan didaftarkan oleh Kementerian Kesehatan kepada BPJS Kesehatan'),
(34, 'FAQ', 'Berapa besaran iuran Peserta Pekerja Penerima Upah (PPU)?', 'luran dibayarkan oleh pemberi kerja dan peserta dengan besaran iuran antara lain:\na. PPU Penyelenggara Negara\n- Pemberi kerja: 4%\n- Pekerja atau pensiunan: 1%\nb. PPU Non Penyelenggara Negara\n- Pemberi kerja: 4%\n- Pekerja atau pensiunan: 1%'),
(35, 'FAQ', 'Apa yang dimaksud dengan Close Payment System', 'Close Payment System atau sistem pembayaran tertutup adalah mekanisme pembayaran iuran Peserta Pekerja Penerima Upah Badan Usaha (PPU BU) BPJS Kesehatan, yang memastikan transaksi pembayaran iuran hanya dapat dilakukan jika besaran iuran yang dibayarkan sama dengan tagihan atau kelipatannya'),
(36, 'FAQ', 'Apa yang dimaksud fasilitas kesehatan tingkat pertama', 'Fasilitas Kesehatan Tingkat Pertama yang selanjutnya disingkat FKTP adalah fasilitas kesehatan yang melakukan pelayanan kesehatan perorangan yang bersifat non spesialistik untuk keperluan observasi, promotif, preventif, diagnosis, perawatan, pengobatan, dan/atau pelayanan kesehatan lainnya'),
(37, 'FAQ', 'Siapa yang dimaksud Pekerja Bukan Penerima Upah', 'Pekerja Bukan Penerima Upah adalah setiap orang yang bekerja atau berusaha atas risiko sendiri, yang terdiri dari: Notaris/Pengacara/LSM, Dokter/Bidan Praktek Swasta, Pedangang/Penyedia Jasa, Petani/Peternak, Nelayan, Supir, Ojek, Montir dan pekerja lain yang mampu membayar iuran'),
(38, 'FAQ', 'Apakah yang dimaksud dengan BPJS Kesehatan', 'BPJS Kesehatan adalah badan hukum yang dibentuk untuk menyelenggarakan program Jaminan Kesehatan Nasional- Kartu Indonesia Sehat (JKN-KIS) yang merupakan jaminan berupa perlindungan kesehatan agar peserta memperoleh manfaat pemeliharaan kesehatan dan perlindungan dalam memenuhi kebutuhan dasar kesehatan yang diberikan kepada setiap orang yang telah membayar iuran atau iurannya dibayarkan oleh Pemerintah'),
(39, 'FAQ', 'FAQ Besaran Denda Layanan?', 'Besaran Pengenaan Denda Layanan yaitu: 5% (lima persen) dari perkiraan biaya paket Indonesian Case Based Groups berdasarkan diagnosa dan prosedur awal untuk setiap bulan tertunggak dengan ketentuan: - Jumlah bulan menunggak paling banyak 12 (dua belas) bulan; dan -Bbesar denda paling tinggi Rp30.000.000,00 (tiga puluh juta rupiah)'),
(40, 'FAQ', 'Siapa saja yang dimaksud Bukan Pekerja', 'Bukan Pekerja adalah setiap orang yang bukan termasuk masyarakat yang didaftarkan dan iurannya dibayar oleh Pemerintah Pusat/Daerah, PPU serta PBPU, yang terdiri dari: BP Penyelenggara Negara dan BP Non Penyelenggara Negara. \n1) BP Penyelenggara Negara terdiri dari Penerima Pensiun (PP) Pejabat Negara, PP PNS Pusat/Daerah, PP TNI, PP POLRI, Veteran dan Perintis Kemerdekaan. \n2) BP Non Penyelenggara Negara terdiri dari Investor, Pemberi Kerja dan BP lain yang mampu membayar iuran.');
INSERT INTO `infos` (`id`, `type`, `title`, `content`) VALUES
(41, 'FAQ', 'Bagaimana Jika Kartu Peserta Rusak?', 'A. Peserta dapat mengunjungi kantor BPJS Kesehatan/ Mobile Customer Service/ Mall pelayanan publik dengan ketentuan: \n1. Menyerahkan kartu peserta yang rusak. \n2. Menunjukkan KTP atau Kartu Keluarga yang berlaku. \n3. Penggantian kartu dapat dilakukan di Kantor Cabang atau Kantor Kabupaten/Kota BPJS Kesehatan terdekat. \nB. Peserta dapat menggunakan Mobile JKN pada fitur \"Kartu Peserta\" sebagai pengganti kartu JKN-KIS untuk mendapatkan pelayanan di fasilitas kesehatan.'),
(42, 'FAQ', 'Apa Kewajiban Peserta?', '1. Mendaftarkan diri dan anggota keluarganya sebagai peserta JKN-KIS kepada BPJS Kesehatan. \n2. Membayar iuran secara rutin setiap bulan sebelum tanggal 10 (sepuluh). 3. Memberikan data dirinya dan \nanggota keluarganya secara lengkap dan benar. \n4. Melaporkan perubahan data dirinya dan anggota keluarganya, antara lain perubahan golongan, pangkat atau besaran gaji, pernikahan, perceraian, kematian, kelahiran, pindah alamat/domisili dan pindah fasilitas kesehatan tingkat pertama serta perubahan alamat email dan nomor handphone \n5. Menjaga kartu peserta agar tidak rusak, hilang atau dimanfaatkan oleh orang yang tidak berhak. \n6. Mentaati semua ketentuan dan tata cara pelayanan kesehatan.'),
(43, 'FAQ', 'Pendaftaran Bayi Baru Lahir?', '1. Bayi baru lahir dari Peserta JKN wajib didaftarkan kepada BPJS Kesehatan paling lama 28 hari sejak dilahirkan \n2. Pendaftaran bayi dapat mengaktifkan status kepesertaan untuk mendapatkan manfaat jaminan pelayanan kesehatan selama 28 hari sejak bayi dilahirkan dan masih dalam perawatan. \n3. Status kepesertaan bayi baru lahir (No. Kepesertaan JKN KIS) harus dipastikan selambat-lambatnya 3 hari kerja sejak dirawat, atau < 3 hari jika pulang rawat sebelum 3 hari \n4. luran bagi bayi baru lahir dibayarkan oleh Peserta atau pihak lain atas nama Peserta pada saat mendaftar paling lama 28 (dua puluh delapan) hari sejak dilahirkan \n5. Tidak mendaftar & membayar iuran bayi baru lahir paling lama 28 hari sejak dilahirkan akan dikenakan kewajiban membayar iuran sejak bayi dilahirkan dan dikenakan sanksi denda pelayanan 6. Bayi yang dilahirkan bukan dari Peserta JKN, maka berlaku ketentuan pendaftaran Peserta PBPU dan BP (14 hari)'),
(44, 'FAQ', '', ''),
(45, 'FAQ', 'Ketentuan Pelayanan Protesa Gigi/ Gigi Palsu?', '1. Pelayanan protesa gigi hanya diberikan atas rekomendasi dokter gigi pada FKTP atau dokter gigi spesialis prostodonsia pada FKRTL yang bekerja sama dengan BPJS Kesehatan. \n2. Pada FKTP yang tidak memiliki dokter gigi/ jejaring dokter gigi, maka diprioritaskan melakukan rujukan horizontal antar FKTP. \n3. Protesa gigi/gigi palsu dapat diberikan paling cepat 2 (dua) tahun sekali atas indikasi medis untuk gigi yang sama dengan total besaran maksimal Rp. 1.000.000,00. Dalam hal diperlukan pelayanan protesa gigi pada episode berbeda dalam periode 2 (dua) tahun maka berlaku ketentuan suplesi. Adapun besaran nilai bantuan alat kesehatan protesa gigi adalah sebagai berikut: \na. Full protesa gigi maksimal Rp. 1.000.000,00 (Masing masing rahang maksimal Rp. 500.000,00) \nb. Rincian per rahang adalah: \n- 1-8 gigi: Rp. 250.000,- \n-9-16 gigi: Rp. 500.000,- \n4. Apabila penjaminan alat protesa gigi melibatkan elemen gigi yang sudah pernah diberikan bantuan dalam kurun waktu kurang dari 2 (dua) tahun maka tidak dapat dijamin oleh BPJS Kesehatan \n5. Apabila sebelum 2 tahun diperlukan penggantian protesa gigi oleh sebab apapun maka BPJS Kesehatan tidak menjamin'),
(46, 'FAQ', 'cara Melakukan Perubahan Kelas Rawat', 'I. Peserta PPU \nSyarat perubahan kelas rawat \na. Kartu Keluarga \nb. Daftar gaji asli dari pemberi kerja \nc. Perubahan gaji/upah yang dilakukan pada bulan berjalan, maka kelas perawatan baru akan berlaku pada bulan selanjutnya.. \nII. Peserta PBPU/BP \nSyarat perubahan kelas rawat a. Perubahan kelas rawat dapat dilakukan setelah 1 (satu) tahun dan harus diikuti perubahan kelas rawat seluruh anggota keluarga. \nb. Peserta yang melakukan perubahan kelas perawatan pada bulan berjalan, maka kelas perawatan barunya berlaku pada bulan selanjutnya. \nc. Adapun persyaratan perubahan kelas rawat yaitu asli/fotokopi Kartu Keluarga. \nd. Bagi peserta yang belum melakukan Autodebit rekening tabungan dilengkapi dengan: \n1) Fotokopi buku rekening tabungan BRI, Mandiri, BNI, BTN, dan BCA (dapat menggunakan rekening tabungan Kepala Keluarga/ anggota keluarga dalam Kartu Keluarga/penanggung. \n2) Formulir Autodebit pembayaran iuran BPJS Kesehatan bermaterai Rp10.000,00 (Sepuluh Ribu Rupiah).'),
(47, 'FAQ', 'Ketentuan Penjaminan Kaca Mata?', '1.Pemeriksaan Refraksi mata diberikan atas rekomendasi dari dokter di FKTP yang dapat dibantu oleh refraksionis, atau dirujuk ke spesialis Mata di FKRTL apabila memenuhi kriteria Rujukan dan atau TACC \n2. Pelayanan alat bantu kaca mata pada Optik yang bekerjasama dengan BPJS Kesehatan \n3. Ketentuan penjaminan kacamata yang dijamin oleh BPJS Kesehatan diberikan maksimal 1 kali dalam 2 (dua) tahun dengan ukuran sebagai berikut: \n- Untuk lensa spheris, minimal 0.5 Dioptri \n- Untuk lensa silindris minimal 0.25 Dioptri \n4. Penjaminan kacamata tidak dapat diberikan jika: \n- tidak memenuhi indikasi medis atau sebelum 2 (dua) tahun sejak tanggal legalisasi kacamata; \n- pada kasus penggantian bingkai kacamata saja; \n- pada kasus ADD (Additional Value) saja, yaitu untuk mengoreksi presbiopia (rabun tua) atau untuk kebutuhan baca \n5. Apabila sebelum 2 tahun diperlukan penggantian kacamata oleh sebab apapun (perubahan ukuran, hilang, rusak dan sebab lain) maka BPJS Kesehatan tidak menjamin \n6. Besaran maksimal bantuan alat kesehatan kaca mata adalah sebagai berikut: \n- PBI/Hak rawat kelas 3: Rp 165.000,00 \n- Hak rawat kelas 2: Rp 220.000,00 \n- Hak rawat kelas 1: Rp 330.000,00'),
(48, 'FAQ', 'Apakah yang dimaksud dengan anggota keluarga yang lain bagi Peserta Pekerja Penerima Upah', 'Anggota keluarga yang lain meliputi anak ke-4 dan seterusnya, ayah, ibu dan mertua'),
(49, 'FAQ', 'Apakah yang dimaksud dengan luran Jaminan Kesehatan', 'luran Jaminan Kesehatan adalah sejumlah uang yang dibayarkan secara teratur oleh Peserta, Pemberi Kerja dan/atau Pemerintah untuk program Jaminan Kesehatan'),
(50, 'FAQ', 'Siapakah yang dimaksud dengan Peserta', 'Peserta adalah Semua penduduk Indonesia, termasuk orang asing yang telah bekerja paling singkat 6 (enam) bulan di Indonesia dan telah membayar juran'),
(51, 'FAQ', 'Bagaimana jika pada saat registrasi BU tidak menerima link aktivasi di email yang di daftarkan', 'PIC BU menghubungi kantor BPJS Kesehatan Sesuai dengan wilayah perusahaan terdaftar untuk di kirim ulang link aktivasi kepada badan usaha'),
(52, 'FAQ', 'Apa yang dimaksud asuransi kesehatan tambahan', 'Asuransi kesehatan tambahan adalah asuransi kesehatan komersial yang dibeli secara sukarela di luar asuransi kesehatan sosial yang bersifat wajib'),
(53, 'FAQ', 'Bagaimana jika pada saat registrasi BU tidak menerima link aktivasi di email yang di daftarkan', 'PIC BU menghubungi kantor BPJS Kesehatan Sesuai dengan wilayah perusahaan terdaftar untuk di kirim ulang link aktivasi kepada badan usaha'),
(54, 'FAQ', 'Cara Melakukan Perubahan Alamat', 'Peserta melaporkan perubahan alamat ke Kantor BPJS Kesehatan setempat, dengan persyaratan: \na. Kartu identitas peserta JKN-KIS; \nb. Kartu Tanda Penduduk elektronik dan Kartu Keluarga'),
(55, 'FAQ', 'Cara mengaktifkan kartu anak PPU yang masih kuliah', 'Untuk anak 21 tahun yang masih kuliah/belum menikah/belum bekerja dapat dilakukan perpanjangan masa berlaku kepesertaan melalui HRD/PIC perusahaan/satuan kerja dengan melampirkan surat keterangan sekolah/perguruan tinggi semester berjalan'),
(56, 'FAQ', 'Dimana saja tempat pendaftaran Peserta Pekerja Penerima Upah', 'a. Website BPJS Kesehatan www.bpjs- kesehatan.go.id \nb. Portal bersama BPJS www.bpjs.go.id \nc. ONLINE SINGLE SUBMISSION (OSS) \nd. Aplikasi Edabu Mobile yang bisa diunduh melalui Google Playstore dan Apps Store \ne. Kantor Cabang/Kab/Kota'),
(57, 'FAQ', 'Siapa yang dimaksud Pekerja Penerima Upah', 'Pekerja Penerima Upah adalah setiap orang yang bekerja pada pemberi kerja dengan menerima gaji atau upah, seperti Pegawai Negeri Sipil, Anggota TNI, Anggota POLRI, Pejabat Negara, Pimpinan dan Anggota Dewan Perwakilan Rakyat Daerah, Pegawai Pemerintah Non Pegawai Negeri, Pegawai Swasta, dan Pekerja lain yang menerima upah'),
(58, 'FAQ', 'Apa yang dimaksud fasilitas kesehatan rujukan tingkat lanjutan', 'Fasilitas Kesehatan Rujukan Tingkat Lanjutan yang selanjutnya disingkat FKRTL adalah fasilitas kesehatan yang melakukan pelayanan kesehatan perorangan yang bersifat spesialistik atau sub spesialistik yang meliputi rawat jalan tingkat lanjutan, rawat inap tingkat lanjutan dan rawat inap di ruang perawatan khusus'),
(59, 'FAQ', 'cara mengaktifkan kartu peserta diatas 90 tahun yang dinonaktifkan', 'Untuk pengaktifan kembali bagi peserta yang di nonaktifkan karena usia > 90 tahun dengan menunjukan : \na. Kartu JKN KIS ( Jaminan Kesehatan Nasional - Kartu Indonesia Sehat) \nb. SK pensiun \n.  \nd. Kartu Keluarga \nPelaporan dapat dilakukan melalui Kantor Cabang atau Pelayanan Whatsapp Administrasi (PANDAWA)'),
(60, 'FAQ', 'Pengurangan anggota keluarga pernikahan/ perceraian', 'a. Peserta PBI Peserta melaporkan ke Dinas Sosial setempat, dengan menunjukkan surat nikah/cerai. \nb. Peserta PPU Bagi PPU Penyelenggara Negara laporan peserta meninggal disampaikan ke Kantor BPJS Kesehatan setempat. Sedangkan bagi PPU Non Penyelenggara Negara laporan peserta menikah/cerai disampaikan ke PIC Badan Usaha, dengan menunjukkan surat nikah/cerai. \nc. Peserta PBPU/BP Peserta melaporkan ke kantor BPJS Kesehatan, dengan syarat: \n1. surat nikah/cerai \n2. Kartu Keluarga \n3. Kartu Identitas Peserta JKN-KIS.'),
(61, 'FAQ', 'Cara Melakukan Perubahan Jenis Kepesertaan Peserta PBI JK/PD Pemda menjadi peserta PBPU', '1) Asli Kartu JKN-KIS \n2) Asli/Fotocopy Kartu Keluarga \n3) Fotokopi buku rekening tabungan BRI, Mandiri, BNI, BTN, dan BCA (dapat menggunakan rekening tabungan Kepala Keluarga/anggota keluarga dalam Kartu Keluarga/penanggung. \n4) Formulir Autodebit pembayaran iuran BPJS Kesehatan bermaterai Rp10.000,00 (Sepuluh Ribu Rupiah). \n5) Peserta PBI JK aktif yang beralih menjadi peserta PBPU pada bulan berjalan, maka pembayaran iuran dibayarkan pada tanggal 1 (satu) bulan berikutnya dan status kepesertaan sebagai PBPU akan aktif sejak iuran dibayarkan, apabila iurannya tidak dibayarkan setelah melewati 1 (satu) bulan, maka diberlakukan proses administrasi menunggu 14 (empat belas) hari'),
(62, 'FAQ', 'Kanal Layanan BPJS Kesehatan?', 'Kanal Layanan merupakan tempat/media yang dapat digunakan oleh calon peserta atau peserta JKN- KIS dalam melakukan proses administrasi kepesertaan berupa pendaftaran peserta, perubahan data peserta, pembayaran iuran, pemberian informasi dan penanganan pengaduan, yang terdiri dari: \na. Aplikasi Mobile JKN. \nb. BPJS Kesehatan Care Center 165 \nc. Mobile Customer Service (MCS). d. Website BPJS Kesehatan \ne. Mall Pelayanan Publik bekerjasama. f. PANDAWA (Pelayanan Administrasi Melalui Whatsapp) \ng. Kantor Cabang dan Kantor Kabupaten/Kota. \nh. PIPP FKTP \nI. PIPP FKRTL'),
(63, 'FAQ', 'Bagaimana Pelayanan di luar wilayah domisili', 'Sesuai Pepres 82 Tahun 2018 untuk Pelayanan di luar wilayah domisili Peserta datang ke FKTP tempat Peserta terdaftar maupun FKTP lain diluar tempat peserta terdaftar serta menunjukkan kartu identitas peserta JKN-KIS/KIS Digital dengan status aktif dan/atau identitas lain yang diperlukan (KTP, SIM, KK). Saat Bapak/Ibu sedang berada diluar daerah (dengan jarak tempuh yang tidak memungkinkan untuk menuju ke Faskes tingkat 1 terdaftar, maka dapat mengakses pelayanan kesehatan pada faskes tingkat 1 bekerjasama dengan BPJS Kesehatan terdekat maksimal untuk 3x kunjungan dalam waktu paling lama 1 bulan di FKTP yang sama'),
(64, 'FAQ', 'Ketentuan penonaktifan peserta meninggal', 'a Peserta PBI Anggota keluarga Peserta/yang mewakili melaporkan ke kantor BPJS Kesehatan atau Dinas Sosial setempat, dengan syarat: \n1. surat keterangan kematian dari desa/kelurahan \n2. Kartu Identitas Peserta JKN-KIS. \nb. Peserta PPU Bagi PPU Penyelenggara Negara laporan peserta meninggal disampaikan ke Kantor BPJS Kesehatan setempat. Sedangkan bagi PPU Non Penyelenggara Negara laporan peserta meninggal disampaikan ke PIC Badan Usaha. Syarat yang dibutuhkan: \n1. surat keterangan kematian dari desa/kelurahan \n2. Kartu Identitas Peserta JKN-KIS. \nc. Peserta PBPU/BP Anggota keluarga Peserta/yang mewakili melaporkan ke kantor BPJS Kesehatan, dengan syarat: \n1) Surat keterangan kematian dari Fasilitas Kesehatan/Desa/Kelurahan \n2) Asli Kartu identitas peserta JKN-KIS. \n3) Asli/Fotokopi Kartu Keluarga \n4) Bukti pembayaran iuran'),
(65, 'FAQ', 'Bagaimana Jika Peserta Menginginkan Kenaikan Kelas Perawatan', 'I. Peserta PBI dan Peserta yang didaftarkan oleh Pemerintah Daerah gugur haknya apabila memilih kelas yang lebih tinggi dari haknya. II. Peserta Bukan PBI, dapat meningkatkan haknya maksimal 1 tingkat lebih tinggi dengan membayar sendiri seluruh selisih antara biaya yang dijamin oleh BPJS Kesehatan dengan biaya yang harus dibayar akibat peningkatan kelas perawatan, dengan ketentuan sebagai berikut: \na. Peserta mengikuti prosedur sesuai ketentuan yang berlaku. \nb. Peserta membayar tambahan biaya, dengan perhitungan sebagai berikut: \n1) Untuk peningkatan kelas pelayanan rawat inap dari kelas perawatan III ke kelas II, dan dari kelas perawatan II ke kelas I, membayar selisih biaya antara Tarif INA-CBG pada kelas rawat inap lebih tinggi yang dipilih dengan Tarif INA-CBG pada kelas rawat inap yang sesuai dengan hak Peserta \n2) Untuk peningkatan kelas pelayanan rawat inap di atas kelas perawatan I, membayar selisih biaya paling banyak sebesar 75% (tujuh puluh lima perseratus) dari Tarif INA-CBG kelas perawatan | Jika hak kelas rawat peserta kelas I, perhitungan tambahan biaya maksimal : 75% x Tarif INA-CBG kelas I'),
(66, 'FAQ', 'Pelayanan Kesehatan yang tidak dijamin?', '1. pelayanan kesehatan yang tidak sesuai dengan ketentuan peraturan perundang-undangan; \n2. pelayanan kesehatan yang dilakukan di Fasilitas Kesehatan yang tidak bekerja sama dengan BPJS Kesehatan, kecuali dalam keadaan darurat; \n3. pelayanan kesehatan terhadap penyakit atau cedera akibat Kecelakaan. Kerja atau hubungan kerja yang telah dijamin oleh program jaminan Kecelakaan Kerja atau menjadi tanggungan Pemberi Kerja; \n4. pelayanan kesehatan yang dijamin oleh program jaminan kecelakaan lalu lintas yang bersifat wajib sampai nilai yang ditanggung oleh program jaminan kecelakaan lalu lintas sesuai hak kelas rawat Peserta; \n5. pelayanan kesehatan yang dilakukan di luar negeri; \n6. pelayanan kesehatan untuk tujuan estetik; \n7. pelayanan untuk mengatasi \ninfertilitas; \n8. pelayanan meratakan gigi atau ortodonsi; \n9. gangguan kesehatan/penyakit akibat ketergantungan obat dan/atau alkohol; 10. gangguan kesehatan akibat sengaja menyakiti diri sendiri atau akibat melakukan hobi yangmembahayakan diri sendiri;'),
(67, 'FAQ', 'Cara Melakukan Perubahan Jenis Kepesertaan Peserta PPU menjadi Peserta PBPU', '1) Pekerja sudah tidak lagi sebagai PPU yang ditunjukkan dengan status peserta dinonaktifkan oleh Badan Usaha. \n2) Peserta PPU yang beralih menjadi Peserta PBPU/ BP pada bulan berjalan sebelum dinonaktifkan, maka pembayaran iuran baru dapat dibayarkan pada tanggal 1 bulan berikutnya dan status kepesertaan sebagai PBPU akan aktif sejak iuran dibayarkan. \n3) Dalam hal peralihan dilakukan selambat-lambatnya 1 bulan sejak status PPU dinyatakan non aktif, maka Status Peserta langsung aktif (tanpa menunggu 14 hari). Jika melebihi 1 bulan, maka status peserta tidak langsung aktif (menunggu 14 hari). \n4) Melengkapi persayaratan sebagai berikut: \na) Asli Kartu JKN-KIS \nb) Asli/Fotocopy Kartu Keluarga \nc) Fotokopi buku rekening tabungan BRI, Mandiri, BNI, BTN, dan BCA (dapat menggunakan rekening tabungan Kepala Keluarga/anggota keluarga dalam Kartu Keluarga/penanggung. d) Formulir Autodebit pembayaran iuran BPJS Kesehatan bermaterai Rp10.000,00 (Sepuluh Ribu Rupiah)'),
(68, 'FAQ', 'Jenis Alat Bantu Kesehatan yang dijamin?', '1. Kacamata \n2. Alat bantu dengar (hearing aid) \n3. Protesa alat gerak (kaki dan/atau tangan tiruan) \n4. Protesa gigi/gigi palsu \n5. Korset Tulang Belakang (Corset) \n6. Penyangga leher (collar neck/cervical collar/neck brace) \n7. Alat bantu gerak berupa kruk penyangga tubuh'),
(69, 'FAQ', 'Pelayanan Kesehatan yang dijamin BPJS Kesehatan yaitu', '1. Pelayanan Kesehatan tingkat pertama \n2. Pelayanan Kesehatan rujukan tingkat lanjut \n3. Pelayanan Ambulan darat atau air'),
(70, 'FAQ', 'Bagaimana Jika Lupa Password atau password Salah?', '1. Pilih menu lupa password \n2. Masukan Nomor Kartu BPJS \n3. Masukan Nomor Handphone untuk verifikasi \n4. Masukan Password Baru sesuai nstandar \n5. Klik Reset Password'),
(71, 'FAQ', 'Apa yang dimaksud dengan Pelayanan Kesehatan Darurat Medis', 'Yaitu pelayanan kesehatan yang harus diberikan secepatnya untuk mencegah kematian, keparahan, dan/atau kecacatan sesuai dengan kemampuan fasilitas kesehatan'),
(72, 'FAQ', 'Apa yang dimaksud dengan Rawat Jalan Tingkat Pertama', 'Yaitu pelayanan kesehatan perorangan yang bersifat non spesialistik yang dilaksanakan pada fasilitas kesehatan tingkat pertama untuk keperluan observasi, diagnosis, pengobatan, dan/atau pelayanan kesehatan lainnya'),
(73, 'FAQ', 'Apa yang dimaksud dengan Pelayanan Kesehatan Rujukan Tingkat Lanjutan', 'Yaitu upaya pelayanan kesehatan perorangan yang bersifat spesialistik atau sub spesialistik yang meliputi rawat jalan tingkat lanjutan, rawat inap tingkat lanjutan, dan rawat inap di ruang perawatan khusus'),
(74, 'FAQ', 'Apa yang dimaksud dengan Pelayanan Kesehatan Rujukan Tingkat Lanjutan', 'Pelayanan Kesehatan Rujukan Tingkat Lanjutan adalah upaya pelayanan kesehatan perorangan yang bersifat spesialistik atau sub spesialistik yang meliputi rawat jalan tingkat lanjutan, rawat inap tingkat lanjutan, dan rawat inap di ruang perawatan khusus'),
(75, 'FAQ', 'Apakah yang dimaksud dengan Kecurangan (Fraud) dalam Pelaksanaan Program Jaminan Kesehatan Nasi', 'Kecurangan (Fraud) adalah tindakan yang dilakukan dengan sengaja, untuk mendapatkan keuntungan finansial dari program Jaminan Kesehatan Nasional dalam Sistem Jaminan Sosial Nasional melalui perbuatan curang yang tidak sesuai dengan ketentuan'),
(76, 'FAQ', 'Apa yang dimaksud fasilitas kesehatan', 'Fasilitas kesehatan adalah fasilitas pelayanan kesehatan yang digunakan untuk menyelenggarakan upaya pelayanan kesehatan perorangan, baik promotif, preventif, kuratif dan rehabilitative yang diselenggarakan oleh Pemerintah, Pemerintah Daerah, dan/atau masyarakat'),
(77, 'FAQ', 'Bagaimana cara mengaktifkan kartu anak PPU yang masih kuliah', 'Untuk anak 21 tahun yang masih kuliah/belum menikah/belum bekerja dapat dilakukan perpanjangan masa berlaku kepesertaan melalui HRD/PIC perusahaan/satuan kerja dengan melampirkan surat keterangan sekolah/perguruan tinggi semester berjalan sampai maksimal usia 25 tahun atau dapat membawa surat keterangan sekolah/perguruan tinggi semester berjalan ke Kantor BPJS Kesehatan terdekat'),
(78, 'FAQ', 'Apa Kewajiban Pemberi Kerja', '1. Mendaftarkan diri dan pekerjanya sebagai peserta JKN-KIS kepada BPJS Kesehatan. \n2. Menghitung dan memungut iuran yang menjadi kewajiban pekerjanya melalui pemotongan gaji/upah pekerja. \n3. Membayar dan menyetorkan iuran yang menjadi tanggung jawabnya kepada BPJS Kesehatan secara rutin setiap bulan sebelum tanggal 10 (sepuluh). \n4. Memberikan data mengenai diri, pekerja dan anggota keluarganya secara lengkap dan benar meliputi: \na. data pekerja berikut anggota keluarganya yang didaftarkan sesuai'),
(79, 'FAQ', 'Kriteria Pekerja terkena PHK yang mendapat Jaminan 6 Bulan tanpa membayar iuran', 'a. PHK yang sudah ada putusan pengadilan hubungan industrial, dibuktikan dengan putusan/akta pengadilan hubungan industrial; \nb. PHK karena penggabungan perusahaan, dibuktikan dengan akta notaris; \nc. PHK karena perusahaan pailit atau mengalami kerugian, dibuktikan dengan putusan kepailitan dari pengadilan; atau \nd. PHK karena Pekerja mengalami sakit yang berkepanjangan dan tidak mampu bekerja, dibuktikan dengan surat dokter'),
(80, 'FAQ', 'Syarat Pendaftaran Autodebet', 'I. Bank mitra kerjasama (BNI/BCA/MANDIRI/BRI/BTN/BANK JATENG/BANK NAGARI selain jenis syariah dan tabunganku) dan dapat melalui Kantor BPJS Kesehatan dengan persyaratan sebagaimana terlampir : 1. FC Buku Rekening Tabungan 2. FC KK dan FC KTP peserta 3. FC KK dan FC KTP pemilik rekening 4. Materai Rp. 10.000,- 1 lembar 5. Mengisi formulir autodebet yang ditanda tangani pemilik rekening II. Online (Bank/Non Perbankan) melalui Aplikasi Mobile JKN, Aplikasi Mitra BPJS Kesehatan dan USSD:  \n1. Aplikasi Mobile JKN \n(BRI/MANDIRI/BTN/BCA/Finpay/Doku/I \nSaku/Visa Master) \n2. Aplikasi i-saku \n3. Aplikasi Tokopedia \n4. Aplikasi Gojek \n5. Aplikasi DANA \n6. Via USSD \n7. Website BPJS Kesehatan (MANDIRI/BCA/Visa Master)'),
(81, 'FAQ', 'Cara Penonaktifan Peserta Keluar Negeri?', '1. Peserta JKN Berada Di Luar Negeri Sekurangnya 6 (enam) Bulan berturut-turut \n2. Pelaporan dilakukan melalui Kantor Cabang/kanal layanan \n3. Peserta membayarkan iuran sampai dengan bulan keberangkatan ke luar negeri Syarat \na. salinan visa Peserta dan/atau anggota keluarga; \nb. data anggota keluarga yang tinggal di luar negeri; \nc. ijin tinggal di luar negeri; \nd. surat tugas belajar; \ne. surat tugas bekerja; \nf. surat pernyataan penghentian pembayaran gaji dari Pemberi Kerja; atau \ng. surat pemberitahuan dari sponsor'),
(82, 'FAQ', 'Cara Mendaftar Menjadi Peserta PBPU/BP Non Penyelenggara Negara', 'a. Kartu Keluarga \nb. Buku tabungan Bank yang melayani autodebit BRI, Mandiri, BNI, BTN, BCA, Bank Jateng dan Bank Panin (dapat menggunakan rekening tabungan Kepala Keluarga/ anggota keluarga dalam Kartu Keluarga/ penanggung).  \nc. Formulir surat kuasa autodebit pembayaran iuran BPJS Kesehatan bermaterai Rp10.000,00 (Sepuluh Ribu Rupiah) yang ditanda tangani pemilik rekening yang bersangkutan. Surat kuasa wajib ditanda tangani oleh pemilik rekening walaupun calon peserta yang mendaftar bukan pemilik rekening. \nd. Paspor dan surat izin kerja yang diterbitkan instansi berwenang bagi Warga Negara Asing. Calon peserta dapat melakukan pembayaran iuran pertama dalam waktu paling cepat 14 (empat belas) hari atau paling lambat 30 (tiga puluh) hari setelah pendaftaran'),
(83, 'FAQ', 'Prosedur refund (pengembalian kelebihan pembayaran)', 'I. Pengembalian iuran (refund) dapat dilakukan dengan alasan sebagai berikut: \n1. Kelebihan pembayaran iuran oleh peserta atau pemberi kerja \n2. Kelebihan pembayaran iuran oleh pemerintah daerah bagi PBPU/BP Pemda \n3. Peserta meninggal dunia \n4. Kepesertaan ganda \n5. Salah setor rekening \n6. Kesalahan pencatatan oleh Bank atau PPOB \n7. Salah setor Virtual Account Pengajuan pengembalian iuran paling lama dilakukan 15 hari sejak tanggal pengajuan pengembalian disampaikan kepada BPJS Kesehatan dan berkas dinyatakan Lengka\n Il Valanalonan hausan untu'),
(84, 'FAQ', 'Cara Melakukan Perubahan Jenis Kepesertaan Peserta PBPU menjadi peserta PPU', '1) Badan Usaha melakukan perubahan jenis kepesertaan pekerja melalui sistem informasi yang telah disediakan oleh BPJS Kesehatan. \n2) Perubahan status kepesertaan menjadi Peserta PPU mengikuti mekanisme cut off kepesertaan BPJS Kesehatan dan jumlah anggota keluarga yang ditanggung PPU. \n3) Perubahan status kepesertaan jumlah anggota keluarga tertanggung PPU, dalam hal jumlah anggota keluarga tertanggung melebihi hak peserta sebagai peserta PPU, maka anggota keluarga lain tetap terdaftar sebagai Peserta PBPU atau dapat didaftarkan sebagai keluarga tambahan dengan besaran iuran sebesar 1% dari gaji atau upah. \n4) Menyerahkan surat keterangan dari sekolah/perguruan tinggi (bagi anak usia lebih dari 21 tahun s.d 25 tahun yang masih sekolah/kuliah).'),
(85, 'FAQ', 'Cara Mendapatkan Pelayanan Ambulan', 'Pelayanan Ambulan merupakan pelayanan transportasi pasien rujukan dengan kondisi tertentu antar fasilitas kesehatan untuk menjaga kestabilan kondisi dan keselamatan pasien yang meliputi pelayanan ambulan darat dan ambulan air untuk rujukan pada: a. antar fasilitas kesehatan tingkat pertama; \nb. dari fasilitas kesehatan tingkat pertama ke fasilitas kesehatan rujukan tingkat lanjut; \nc. antar fasilitas kesehatan rujukan tingkat lanjutan \nAdapun prosedur pelayanan ambulan sebagai berikut: \na. Pasien yang mendapatkan pelayanan ambulan adalah pasien yang memerlukan evakuasi ke fasilitas kesehatan lain sesuai indikasi medis dan ketentuan penjaminan ambulan. \nb. Pelayanan ambulan dijamin bila rujukan dilakukan pada fasilitas kesehatan yang bekerja sama dengan BPJS Kesehatan atau pada kasus gawat darurat dari fasilitas kesehatan yang tidak bekerja sama ke fasilitas kesehatan yang bekerja sama dengan BPJS Kesehatan. \nc. Fasilitas kesehatan yang memiliki fasilitas ambulan dapat langsung memberikan pelayanan ambulan bagi pasien. \nd. Fasilitas kesehatan yang tidak memiliki fasilitas ambulan, maka Fasilitas kesehatan berkoordinasi dengan penyedia ambulan'),
(86, 'FAQ', 'Bagaimana jika terdapat ketidaksesuaian tagihan', 'Apabila terdapat selisih atau perbedaan iuran, Bpk/Ibu dapat melaporkan kekantor BPJS Kesehatan terdekat, dengan membawa serta diantaranya : \n1. Peserta meninggal : Peserta melengkapi surat keterangan kematian dan wajib membayar tunggakan sampai dengan bulan peserta meninggal. \n2. peralihan segmen ke Pekerja Penerima Upah (PPU) : Peserta membawa serta Surat Keputusan pengangkatan sebagai PPU dan kartu keluarga. \n3. Data ganda : Peserta membawa serta identitas (KK/KTP) dan kartu Indonesia Sehat. \n4. Pindah kewarganegaraan Peserta melengkapi dokumen penetapan pindah kewarganegaraan (dibuktikan dengan surat penetapan pindah kewarganegaraan dari instansi berwenang). \n5. nominal iuran peserta muncul lebih dari satu kali pada satu periode bulan tagihan Peserta membawa serta identitas (KK/KTP) dan kartu Indonesia Sehat. \n6. Bayi Baru Lahir : Perhitungan tagihan iuran atas bayi baru lahir dihitung sejak bulan bayi dilahirkan dengan tagihan maksimal 24 bulan dengan membawa surat keterangan kelahiran, kartu keluarga, persyaratan autodebet (Buku Rekening dan KTP Pemilik Rekening)'),
(87, 'FAQ', 'Prosedur refund (pengembalian kelebihan pembayaran)', 'I. Pengembalian iuran (refund) dapat dilakukan dengan alasan sebagai berikut: \n1. Kelebihan pembayaran iuran oleh peserta atau pemberi kerja \n2. Kelebihan pembayaran iuran oleh pemerintah daerah bagi PBPU/BP Pemda \n3. Peserta meninggal dunia \n4. Kepesertaan ganda \n5. Salah setor rekening \n6. Kesalahan pencatatan oleh Bank atau PPOB \n7. Salah setor Virtual Account Pengajuan pengembalian iuran paling lama dilakukan 15 hari sejak tanggal pengajuan pengembalian disampaikan kepada BPJS Kesehatan dan berkas dinyatakan Lengkap. I\nI. Kelengkapan berkas untuk proses penembalian iuran adalah sebagai berikut \n1. Surat permohonan pengembalian iuran oleh peserta/ pemberi kerja/ keluarga peserta dilengkapi materi 10.000 \n2. Salinan KTP Pengaju \n3. Salinan Kartu Keluarga \n4. Bukti Bayar (asli) \n5. Salinan buku tabungan peserta/pemberi kerja/keluarga peserta yang masih aktif \n6. Salinan Kartu JKN/KIS \n7. Surat Kuasa (apabila permohonan pengembalian kelebihan pembayaran dilakukan oleh keluarga peserta) \n8. Surat keterangan kematian (apabila meninggal) \n9. Berita acara rekonsiliasi (apabila kepesertaan ganda)'),
(88, 'FAQ', 'Kriteria Pekerja yang Terkena PHK Namun tidak Mendapat Manfaat Penjaminan 6 Bulan', 'a. Pekerja Meninggal dunia \nb. Pekerja sudah habis Kontrak \nc. Pekerja mengundurkan diri \nd. Pekerja mangkir \ne. Pekerja Pensiun \nf. Pekerja mengundurkan diri \ng. Pekerja dipecat atas kesepakatan Pekerja dan Pemberi Kerja'),
(89, 'FAQ', 'Siapa yang dimaksud dengan Pekerja', 'Pekerja adalah setiap orang yang bekerja dengan menerima gaji, upah, atau imbalan dalam bentuk lain.'),
(90, 'FAQ', 'Bagaimana Cara Mendownload Aplikasi Mobile JKN?', 'Cara Mendownload Aplikasi Mobile JKN yaitu: Buka Google Play Store atau App Store lalu instal/ download aplikasi Mobile JKN Pastikan aplikasi didownload dari pengembang Kesehatan'),
(91, 'FAQ', 'Pelayanan Ambulan yang tidak dijamin', 'a. jemput pasien selain dari fasilitas kesehatan (rumah, jalan, lokasi lain); \nb. mengantar pasien ke selain fasilitas kesehatan; \nc. rujukan parsial (antar jemput pasien atau spesimen dalam rangka mendapatkan pemeriksaan penunjang atau tindakan, yang merupakan rangkaian perawatan pasien di salah satu fasilitas kesehatan); \nd. mengantar jenazah; dan \ne. pasien rujuk balik rawat jalan.'),
(92, 'FAQ', 'Bagaimana jika saya sudah bekerja namun tidak didaftarkan oleh BU', 'Berdasarkan Perpres 82 tahun 2018, setiap Pemberi Kerja wajib mendaftarkan seluruh pekerja dan anggota keluarga. Apabila Ibu/Bapak belum didaftarkan oleh Badan Usaha maka Bapak/Ibu dapat menkonfirmasi ke Kantor BPJS Kesehatan terdekat'),
(93, 'FAQ', 'Ketentuan Pelayanan Gawat Darurat?', 'Syarat \n1. Kriteria gawat darurat, \n2. Pelayanan dilakukan di IGD dan \n3. Sesuai tatalaksana gawatdarurat Kriteria Gawat Darurat: \n1. mengancam nyawa, membahayakan diri dan orang lain/lingkungan; \n2. adanya gangguan pada jalan nafas, pernafasan dan sirkulasi; \n3. adanya penurunan kesadaran; \n4. adanya gangguan hemodinamik; dan/atau \n5. memerlukan tindakan segera'),
(94, 'FAQ', 'Cara Melakukan Perubahan Jenis Kepesertaan Peserta PPU Penyelenggara Negara menjadi Bukan Pekerja', '1) Asli/Fotokopi Surat tanda bukti penerima pensiun/KARIP \n2) Asli/Fotokopi Surat Keputusan Janda/ Duda/ Anak yatim/Anak Piatu atau yatim piatu \n3) Surat keterangan dari sekolah/perguruan tinggi (bagi anak usia lebih dari 21 tahun s.d. 25 tahun yang masih sekolah/kuliah)'),
(95, 'FAQ', 'Apa yang dimaksud dengan Alat Kesehatan', 'Yaitu instrumen, aparatus, mesin, dan/atau implan yang tidak mengandung obat yang digunakan untuk mencegah, mendiagnosa, menyembuhkan dan meringankan penyakit, merawat orang sakit serta memulihkan kesehatan pada manusia dan/atau membentuk struktur dan memperbaiki fungsi tubuh'),
(96, 'FAQ', 'Cara Melakukan Perubahan Jenis Kepesertaan Peserta PPU menjadi PPU', 'Peserta PPU dialihkan menjadi PPU lainnya berdasarkan surat pengantar pendaftaran dari Pimpinan Perusahaan yang baru. Kondisi tersebut berlaku bagi peserta PPU aktif maupun PPU non aktif karena Badan Usaha lama menunggak iuran. Jenis kepesertaan Peserta PPU berlaku untuk bulan selanjutnya'),
(97, 'FAQ', 'Siapa yang dimaksud Pemberi Kerja', 'Pemberi Kerja adalah orang perseorangan, pengusaha, badan hukum atau badan lainnya yang mempekerjakan tenaga kerja, atau penyelenggara negara yang mempekerjakan pegawai negeri dengan membayar gaji, upah, atau imbalan dalam bentuk lainnya'),
(98, 'FAQ', 'Apa yang dimaksud dengan Formularium Nasional', 'Yaitu daftar obat yang disusun oleh komite nasional yang ditetapkan oleh Menteri Kesehatan, didasarkan pada bukti ilmiah mutakhir berkhasiat, aman, dan dengan harga terjangkau yang disediakan serta digunakan sebagai acuan penggunaan obat dalam Jaminan Kesehatan Nasional'),
(99, 'FAQ', 'Apa yang dimaksud dengan Badan Usaha', 'Badan usaha adalah setiap bentuk usaha yang menjalankan usaha yang bersifat tetap dan terus menerus, didirikan, bekerja dan berkedudukan dalam wilayah Negara Kesatuan Republik Indonesia untuk tujuan memperoleh keuntungan dan atau laba, termasuk di dalamnya badan hukum lainnya'),
(100, 'FAQ', 'Pelayanan Kesehatan tingkat pertama yang dijamin BPJS Kesehatan yaitu', '1. Administrasi Pelayanan \n2. Pelayanan Promotif dan preventif \n3. Pemeriksaaan, pengobatan dan konsultasi medis \n4. Tindakan medis nonspesialistik \n5. Pelayanan obat, alat kesehatan dan bahas medis habis pakai \n6. Pemeriksaan penunjang diagnostik labiratorium tingkat pratama \n7. Rawat inap tingkat pertama sesuai dengan indikasi medis'),
(101, 'FAQ', 'Pelayanan Kesehatan rujukan tingkat lanjut yang dijamin BPJS Kesehatan yaitu', '1. Administrasi Pelayanan \n2. Pemeriksaaan, pengobatan dan konsultasi medis dasar \n3. Pemeriksaaan, pengobatan dan konsultasi spesialistik \n4. Tindakan medis spesialistik, baik bedah maupun nonbedah sesuai indikasi medis \n5. Pelayanan obat, alat kesehatan dan bahan medis habis pakai \n6. Pelayana penunjang diagnostik lanjutan sesuai dengan indikasi medis \n7. Rehabilitasi medis \n8. Pelayanan Darah \n9. Pemulasaran jenazah peserta yang meninggal di fasilitas kesehatan 10. pelayanan keluarga berencana 11. Pe'),
(102, 'FAQ', 'Apa syarat pendaftaran bagi peserta yang tidak didaftarkan oleh BU', 'Dokumen Pendaftaran Pekerja yang mendaftarkan diri sebagai PPU; Pemberi Kerja secara nyata tidak mendaftarkan Pekerjanya \n1. Bukti penerimaan gaji/upah bulan terakhir \n2. Identitas yang membuktikan sebagai Pekerja yang diterbitkan oleh Pemberi Kerja \n3. Surat pernyataan status aktif sebagai Pekerja dari Pemberi Kerja \n4. Perjanjian Kerja *Dokumen nomor 1 wajib dipenuhi dan dilampirkan oleh pekerja *Dokumen nomor 2, 3 dan 4 wajib dipenuhi salah satu dan dilampirkan.'),
(103, 'FAQ', 'Cara Mendapatkan Pelayanan Program Rujuk Balik (PRB)', 'Pelayanan Program Rujuk Balik adalah pelayanan bagi pasien dengan diagnosa penyakit kronis Diabetes Mellitus, Hipertensi, Jantung, Asma, Penyakit Paru Obstruktif Kronik (PPOK), Epilepsy, Schizophrenia, Stroke, dan Systemic Lupus Erythematosus (SLE) yang telah ditetapkan dalam kondisi terkontrol/stabil oleh Dokter Spesialis/Sub Spesialis sesuai dengan standar profesi terkait dan telah mendapatkan surat rujuk balik (SRB) dan mendaftarkan diri untuk menjadi peserta PRB. Penjaminan pelayanan bagi peserta PRB adalah pemeriksaan dokter di FKTP dan pemberian obat PRB yang termasuk dalam daftar obat PRB di Formularium Nasional oleh ruang farmasi, instalasi farmasi klinik pratama, atau apotek yang bekerja sama dengan BPJS Kesehatan untuk kebutuhan maksimal 30 (tiga puluh) hari.'),
(104, 'FAQ', 'Mekanisme Pelaporan Pekerja Terkena PHK', 'a. Pelaporan dilakukan oleh Pemberi Kerja atau Serikat Pekerja \nb. Pelaporan dilakukan dengan membawa dokumen pembuktian PHK, data Peserta PHK, dokumen lain sesuai dengan kriteria PHK \nc. Pelaporan pertama kali dilakukan paling lambat tgl 20 setiap bulan berjalan \nd. BPJS Kesehatan memberikan persetujuan tertulis atas pelaporan PHK untuk kemudian diberikan manfaat penjaminan tanpa bayar iuran paling lama 6 bulan'),
(105, 'FAQ', 'Cara Mendaftar Menjadi Peserta Bukan Pekerja (BP) Penyelenggara Negara', '1 Asli KTP \n2 Fotokopi Kartu Keluarga \n3 Asli/Fotokopi surat tanda bukti penerima pensiun atau KARIP \n4 Asli/Fotokopi surat tanda bukti penerima pensiun atau Kartu Tanda Peserta ASABRI \n5 Asli/Fotokopi piagam petikan SK Pengesahan Gelar Kehormatan Veteran RI \n6 Asli/Fotokopi Surat Keputusan Janda/Duda/Anak Yatim/Anak Piatu dan atau Anak Yatim Piatu \n7 Surat Keterangan dari sekolah/Perguruan Tinggi (bagi anak berusia lebih dari 21 (dua puluh satu) tahun sampai dengan 25 (dua puluh lima) tahun'),
(106, 'FAQ', 'Cara Melakukan Perubahan Jenis Kepesertaan Peserta PBI JK/PD Pemda menjadi peserta PPU', '1) Badan Usaha melakukan perubahan jenis kepesertaan pekerja melalui sistem informasi yang telah disediakan oleh BPJS Kesehatan. \n2) Perubahan status kepesertaan menjadi Peserta PPU mengikuti mekanisme cut off kepesertaan BPJS Kesehatan dan jumlah anggota keluarga yang ditanggung PPU. \n3) Dalam hal jumlah anggota keluarga tertanggung melebihi hak peserta sebagai peserta PPU, maka anggota keluarga lainnya: \na) Didaftarkan melalui Badan Usaha sebagai keluarga tambahan dengan besaran iuran sebesar 1% dari gaji atau upah Peserta Pekerja Penerima Upah per orang per bulan (dengan melengkapi surat kuasa pemotongan gaji) \nb) Didaftarkan sebagai Peserta PBPU; atau \nc) Tetap menjadi Peserta PBI JK/PD Pemda \n4) Meyerahkan surat keterangan dari sekolah/perguruan tinggi (bagi anak usia lebih dari 21 tahun s.d. 25 tahun yang masih sekolah/kuliah).'),
(107, 'FAQ', 'Apa syarat pendaftaran LSM', 'Syarat Pendaftaran antara lain : Akta Yayasan dan NPWP Badan'),
(108, 'FAQ', 'Cara Mendaftar Menjadi Peserta PPU Penyelenggara Negara', 'Pendaftaran dilakukan secara kolektif oleh PIC satuan kerja (satker) dan dapat juga dilakukan secara perorangan. \n1. Syarat pendaftaran apabila pendaftaran dilakukan secara perorangan yaitu dengan menunjukkan: \na. Kartu Keluarga \nb. SK Penetapan pertama. \nc. SK Kepangkatan/pengangkatan terakhir dari Kementerian/Lembaga/Kepala Dinas (jika ada perubahan) \nd. Daftar gaji yang mencantumkan gaji pokok dan tunjangan dan dilegalisasi oleh pimpinan unit kerja. \ne. Penetapan Pengadilan Negeri untuk anak angkat (jika belum tercantum dalam Kartu Keluarga). \nf. Asli Surat keterangan dari sekolah/ Perguruan Tinggi (bagi anak usia di atas 21 tahun s.d. 25 tahun) yang berlaku 1 (satu) tahun. \n2. Pendaftaran secara kolektif dilakukan melalui registrasi entitas satuan kerja oleh masing-masing PIC satuan kerja. Kemudian, pendaftaran pekerja dan anggota keluarganya dilakukan melalui proses migrasi dengan mengisi FDIPE (Formulir Daftar Isian Peserta Elektronik). Khusus untuk kepesertaan dari Kepala Desa dan Perangkat Desa proses pendaftaran dan perubahan data dilakukan secara kolektif oleh penanggung jawab Pemerintah Daerah melalui sistem informasi yang telah disediakan oleh BPJS Kesehatan'),
(109, 'FAQ', 'Apa syarat pendaftaran Yayasan', 'Syarat Pendaftaran antara lain : Akta yayasan dan NPWP Badan'),
(110, 'FAQ', 'Apa syarat pendaftaran Rumah Ibadah Asosiasi / organisasi', 'Syarat Pendaftaran antara lain : Akta Pendirian tanpa NPWP'),
(111, 'FAQ', 'Apa syarat pendaftaran PT / Perseroan Terbatas', 'Syarat Pendaftaran antara lain : NIB/Surat Izin Usaha/Tanda Daftar Perusahaan dan NPWP Badan'),
(112, 'FAQ', 'Apa syarat pendaftaran CV', 'Syarat Pendaftaran antara lain : NIB/Surat Izin dan NPWP Badan / Perorangan'),
(113, 'FAQ', 'Apa syarat pendaftaran Usaha Mikro Kecil', 'Syarat Pendaftaran antara lain : NIB/Surat Izin Usaha Mikro Kecil/Surat Izin lainnya sesuai kebijakan Pemerintah Setempat dan NPWP Badan/Perorangan'),
(114, 'FAQ', 'Bagaimana cara Pendaftaran- peserta TNI/POLRI', 'Peserta bisa mengajukan pendaftaran baru melalui chat pandawa dengan melampirkan syarat, yaitu \n1. Asli KTP dan KK \n2. SK Pengangkatan prajurit 3. Slip Daftar Gaji'),
(115, 'FAQ', 'Bagaimana cara Pendaftaran PPU PN (PNS)', 'Peserta bisa mengajukan pendaftaran baru melalui chat pandawa dengan melampirkan syarat, yaitu \n1. Asli KTP dan KK \n2. SK PNS \n3. Slip Daftar Gaji atau Pembuatan/Pencetakan Daftar Gaji (NCR)'),
(116, 'FAQ', 'Bagaimana cara pendaftaran pendaftara PPNPN', 'Pendaftaran bisa dikonfirmasikan ke Satuan Kerja Pemda masing-masing \n1. PIC Satuan Kerja menyampaikan formulir registrasi entitas Satuan Kerja yang disahkan oleh Pejabat yang berwenang dan dokumen pendukung \n2. Pendaftaran secara kolektif dilakukan dengan pengisian Formulir Pendaftaran/ Pengisian Excel Format Migrasi \n3. Melampirkan bukti setor iuran jaminan kesehatan dengan daftar rincian pekerja dan anggota keluarganya \n4. Pendaftaran anak berusia lebih dari 21 tahun s.d 25 tahun dilengkapi dengan surat keterangan sekolah/kuliah'),
(117, 'FAQ', 'Apa syarat pendaftaran Peserta Pensiun TNI', 'Pendaftaran dapat dilakukan secara perorangan maupun kolektif dengan cara mengisi Formulir Daftar Isian Peserta (FDIP) beserta persyaratannya, yaitu \n1. Asli KTP \n2. Fotocopi KK \n3. Asli/Fotokopi surat tanda bukti penerima pensiun atau KARIP \n4. Asli/fotokopi surat tanda bukti penerima pensiun atau Kartu Tanda Peserta ASABRI \n5. Asli/Fotokopi Surat keputusan Janda/Duda/Anak Yatim/Anak Piatu dan atau Anak Yatim Piatu \n6. Surat Keterangan dari Sekolah/Perguruan tinggi (bagi anak berusia lebih dari 21 (dua puluh satu) tahun sampai dengan 25 (dua puluh lima) tahun.'),
(118, 'FAQ', 'Bagaimana Ketentuan Mengenai Penjaminan 6 Bulan Bagi Pekerja yang terkena PHK', 'a. Manfaat Pelayanan yang diterima Peserta yaitu di Ruang Perawatan Kelas 3 \nb. Peserta tidak dapat meningkatkan perawatan yang lebih tinggi dari haknya termasuk rawat jalan \nc. Pemberi Kerja maupun Pekerja tetap berkewajiban membayar iuran jaminan kesehatan sampai dengan adanya putusan yang berkekuatan hukum tetap atas sengketa PHK yang diajukan melalui lembaga penyelesaian perselisihan hubungan industrial \nd. Peserta PHK wajib melaporkan pengaktifan kembali status kepesertaan sebagai Peserta PHK melalui Kantor Cabang setiap bulan sampai dengan Peserta kembali bekerja atau paling lama 6 bulan sejak terjadinya PHK'),
(119, 'FAQ', 'Apa syarat pendaftaran Peserta Pensiun PNS Pusat/Daerah', 'Pendaftaran dapat dilakukan secara perorangan maupun kolektif dengan cara mengisi Formulir Daftar Isian Peserta (FDIP) beserta persyaratannya, yaitu \n1. Asli KTP \n2. Fotocopi KK \n3. Asli/Fotokopi surat tanda bukti penerima pensiun atau KARIP \n4. Asli/fotokopi surat tanda bukti penerima pensiun atau Kartu Tanda Peserta ASABRI \n5. Asli/Fotokopi Surat keputusan Janda/Duda/Anak Yatim/Anak Piatu dan atau Anak Yatim Piatu \n6. Surat Keterangan dari Sekolah/Perguruan tinggi (bagi anak berusia lebih dari 21 (dua puluh satu) tahun sampai dengan 25 (dua puluh lima) tahun'),
(120, 'FAQ', 'Dokumen Pendukung yang Dibutuhkan Dalam Mengajukan Penjaminan 6 Bulan Bagi Pekerja yang terkena PHK', 'a. Dokumen data Peserta dan anggota keluarga PHK berupa nama, NIK, tanggal lahir, nomor identitas Peserta JKN, Alamat, No HP & Email \nb. Dokumen pembuktian PHK, meliputi: \n1) Putusan/akta pengadilan hubungan industrial bagi PHK yang sudah ada putusan pengadilan hubungan industrial; \n2) Akta Notaris bagi PHK karena penggabungan perusahaan; \n3) Putusan kepaillitan dari Pengadilan bagi PHK karena perusahaan pailit atau mengalami kerugian; atau \n4) Surat Keterangan Dokter bagi PHK karena Pekerja mengalami sakit'),
(121, 'FAQ', 'Apa syarat pendaftaran Peserta Pensiun Pejabat Negara', 'Pendaftaran dapat dilakukan secara perorangan maupun kolektif dengan cara mengisi Formulir Daftar Isian Peserta (FDIP) beserta persyaratannya, yaitu \n1. Asli KTP \n2. Fotocopi KK \n3. Asli/Fotokopi surat tanda bukti penerima pensiun atau KARIP \n4. Asli/fotokopi surat tanda bukti penerima pensiun atau Kartu Tanda Peserta ASABRI \n5. Asli/Fotokopi Surat keputusan Janda/Duda/Anak Yatim/Anak Piatu dan atau Anak Yatim Piatu \n6. Surat Keterangan dari Sekolah/Perguruan tinggi (bagi anak berusia lebih dari 21 (dua puluh satu) tahun sampai dengan 25 (dua puluh lima) tahun'),
(122, 'FAQ', 'Apa syarat Pendaftaran Peserta PBPU', 'Syarat pendaftaran apabila pendaftaran dilakukan secara perorangan yaitu dengan menunjukkan: \na. Kartu Keluarga \nb. Buku tabungan Bank yang melayani autodebit BRI, Mandiri, BNI, BTN, BCA, Bank Jateng dan Bank Panin (dapat menggunakan rekening tabungan Kepala Keluarga/ anggota keluarga dalam Kartu Keluarga/ penanggung). *Jika rekening peserta terdaftar tanpa buku tabungan (program dari Bank) maka tidak bisa didaftarkan melalui KC/CC, silahkan buat rekening baru dengan buu tabungan atau bisa dilanjutkan pedaftaran melalui Mobile JKN (dilihat dari nomor rekening) \nc. Formulir surat kuasa autodebit pembayaran iuran BPJS Kesehatan bermaterai Rp10.000,00 (Sepuluh Ribu Rupiah) yang ditanda tangani pemilik rekening yang bersangkutan. Surat kuasa wajib ditanda tangani oleh pemilik rekening walaupun calon peserta yang mendaftar bukan pemilik rekening. Calon peserta dapat melakukan pembayaran iuran pertama dalam waktu paling cepat 14 (empat belas) hari atau paling lambat 30 (tiga puluh) hari setelah pendaftaran'),
(123, 'FAQ', 'Ketentuan Pelayanan Korset Tulang Belakang / Corset?', '1. Pelayanan Korset Tulang Belakang (Corset) merupakan bagian dari pemeriksaan dan penanganan yang diberikan pada FKRTL yang bekerja sama dengan BPJS Kesehatan; \n2. Korset Tulang Belakang (Corset) dapat diberikan maksimal 1 kali dalam 2 (dua) tahun atas indikasi medis dengan besaran maksimal Rp. 350.000,00; \n3. Apabila sebelum 2 tahun diperlukan penggantian Korset Tulang Belakang (Corset) oleh sebab apapun maka BPJS Kesehatan tidak menjamin \n4. Peserta mendapatkan pelayanan medis dan/atau tindakan medis di FKRTL yang bekerja sama dengan BPJS Kesehatan sesuai dengan prosedur pelayanan; \n5. Peserta mengurus keabsahan administrasi Korset Tulang Belakang di FKRTL dengan membawa lembar salinan SEP dan resep Korset Tulang Belakang; \n6. Peserta mengambil Korset Tulang Belakang pada Faskes atau Apotek yang bekerjasama dengan BPJS Kesehatan dengan menyerahkan lembar salinan SEP, resep Korset Tulang Belakang dan bukti keabsahan administrasi. \n7. Petugas Faskes atau Apotek melakukan verifikasi resep dan bukti pendukung lain, kemudian menyerahkan Korset Tulang Belakang kepada Peserta. \n8. Peserta menandatangani bukti pelayanan'),
(124, 'FAQ', 'Ketentuan Pelayanan Alat Bantu Gerak berupa Kruk penyangga tubuh?', '1. Pelayanan Alat bantu gerak berupa kruk penyangga tubuh merupakan bagian dari pemeriksaan dan penanganan yang diberikan pada FKRTL yang bekerja sama dengan BPJS Kesehatan; \n2. Alat bantu gerak berupa kruk penyangga tubuh dapat diberikan paling cepat 5 (lima) tahun sekali atas indikasi medis dengan besaran maksimal Rp. 350.000,- per peserta; \n3. Apabila sebelum 5 tahun diperlukan penggantian kruk oleh sebab apapun maka BPJS Kesehatan tidak menjamin \n4. Peserta mendapatkan pelayanan medis dan/atau tindakan medis di FKRTL yang bekerja sama dengan BPJS Kesehatan sesuai dengan prosedur pelayanan. \n5. Peserta mengurus keabsahan administrasi kruk di FKRTL dengan membawa lembar salinan SEP dan resep kruk. \n6. Peserta mengambil kruk pada Faskes atau Apotek yang bekerjasama dengan BPJS Kesehatan dengan menyerahkan lembar salinan SEP, resep kruk dan bukti keabsahan administrasi. \n7. Petugas Faskes atau Apotek melakukan verifikasi resep dan bukti pendukung lain, kemudian menyerahkan kruk. \n8. Peserta menandatangani bukti pelayanan'),
(125, 'FAQ', 'Ketentuan Pelayanan Protesa Alat Gerak?', '1. Pelayanan Protesa alat gerak (kaki dan/atau tangan tiruan) merupakan bagian dari pemeriksaan dan penanganan yang diberikan pada FKRTL yang bekerja sama dengan BPJS Kesehatan; \n2. Protesa alat gerak dapat diberikan satu kali per peserta dalam kurun waktu 5 (lima) tahun atas indikasi dengan besaran maksimal Rp. 2.500.000,00; \n3. Apabila sebelum 5 tahun diperlukan penggantian protesa alat gerak oleh sebab apapun maka BPJS Kesehatan tidak menjamin \n4. Peserta mendapatkan pelayanan medis dan/atau tindakan medis di FKRTL yang bekerja sama dengan BPJS Kesehatan sesuai dengan prosedur pelayanan; \n5. Peserta mengurus keabsahan administrasi dengan membawa lembar salinan SEP dan resep protesa alat gerak (kaki dan/atau tangan tiruan); \n6. Peserta mengambil protesa alat gerak pada Faskes atau Apotek yang bekerjasama dengan BPJS Kesehatan dengan menyerahkan lembar salinan SEP, resep protesa alat gerak (kaki dan/atau tangan tiruan) dan bukti keabsahan administrasi. \n7. Petugas Faskes atau Apotek melakukan verifikasi resep dan bukti pendukung lain, kemudian menyerahkan protesa alat gerak (kaki dan/atau tangan tiruan) kepada Peserta. \n8. Peserta menandatangani bukti pelayanan'),
(126, 'FAQ', 'Ketentuan Pelayanan Alat Bantu Dengar (Hearing Aid)?', '1. Pelayanan alat bantu dengar (hearing aid) diberikan atas rekomendasi dari dokter spesialis THT serta merupakan bagian dari pemeriksaan dan penanganan yang diberikan pada FKRTL yang bekerja sama dengan BPJS Kesehatan. \n2. Alat bantu dengar dapat diberikan maksimal sekali dalam 5 (lima) tahun atas indikasi medis dengan besaran maksimal Rp. 1.000.000,- per peserta tanpa membedakan satu/dua telinga. \n3. Apabila sebelum 5 tahun diperlukan penggantian alat bantu dengar (hearing aid) oleh sebab apapun (perubahan ukuran, hilang, rusak dan sebab lain) maka BPJS Kesehatan tidak menjamin \n4. Peserta mendapatkan pelayanan medis dan/atau tindakan medis di FKRTL yang bekerja sama dengan BPJS Kesehatan sesuai dengan prosedur pelayanan RJTL; \n5. Peserta mengurus keabsahan administrasi alat bantu dengar (hearing aid) di FKRTL dengan membawa lembar salinan SEP RJTL dan resep alat bantu dengar (hearing aid); \n6. Peserta mengambil alat bantu dengar (hearing aid) pada Faskes atau Optik yang bekerjasama dengan BPJS Kesehatan dengan menyerahkan lembar salinan SEP RJTL, resep alat bantu dengar (hearing aid) dan bukti keabsahan administrasi. \n7. Petugas FKRTL atau Optik melakukan verifikasi resep dan bukti pendukung lain, kemudian menyerahkan alat bantu dengar (hearing aid) kepada Peserta'),
(127, 'FAQ', 'Ketentuan Pelayanan Penyangga Leher (Collar Neck/Cervical Collar/ Neck Brace)?', '1. Pelayanan Penyangga leher (collar neck/cervical collar/neck brace) merupakan bagian dari pemeriksaan dan penanganan yang diberikan pada FKRTL yang bekerja sama dengan BPJS Kesehatan; \n2. Penyangga leher (collar neck/cervical collar/neck brace) dapat diberikan maksimal 1 kali dalam 2 (dua) tahun atas indikasi medis dengan besaran maksimal Rp. 150.000,-; \n3. Apabila sebelum 2 tahun diperlukan penggantian collar neck oleh sebab apapun maka BPJS Kesehatan tidak menjamin. \n4. Peserta mendapatkan pelayanan medis dan/atau tindakan medis di FKRTL yang bekerja sama dengan BPJS Kesehatan sesuai dengan prosedur pelayanan. \n5. Peserta mengurus keabsahan administrasi Penyangga leher (collar neck/cervical collar/neck brace) di FKRTL dengan membawa lembar salinan SEP dan resep Penyangga leher (collar neck/cervical collar/neck brace). \n6. Peserta mengambil Penyangga leher (collar neck/cervical collar/neck brace) pada Faskes atau Apotek yang bekerjasama dengan BPJS Kesehatan dengan menyerahkan lembar salinan. SEP, resep Penyangga leher (collar neck/cervical collar/neck brace) dan bukti keabsahan administrasi \n7. Petugas Faskes atau Apotek melakukan verifikasi resep dan bukti pendukung lain, kemudian menyerahkan Penyangga leher (collar neck/cervical collar/neck brace). \n8. Peserta menandatangani bukti pelayanan');
